INSERT INTO `demo_topic` VALUES ('5bd4772a14e994202cd5bdb7', '504c28a2e2b845157708cb61', 'share', '2018年10月27日晚上，突然收到服务器不能访问的告警通知，拜托了狼叔 @i5ting 帮忙看看，结果登不上也ping不通。\r\n后来收到短信，发现是被ucloud封了，短信内容如下：\r\n\r\n> 【UCloud】尊敬的UCloud用户，您的IP：123.59.77.142  存在URL ：https://cnodejs.org/topic/57239bce5a26c4a841ecbf01 （详细信息请查看邮箱）包含违禁内容（包括但不限于翻墙等），违反了国家有关法律法规。目前依主管单位要求，对您的IP予以封停，请您尽快处理违规内容。待处理完成后请联系技术支持重新开启业务。[4000188113]\r\n\r\n然后联系了ucloud的客服，一下就打通了，对方态度挺好处理问题也快。ucloud说是运营商那边封的，不是他们的检测机制。所以需要联系运营商解决。\r\n考虑到各位亲爱的网友们的行为我无法控制，那么一直跟越来越严格的审查系统对抗只会让自己疲惫，所以我就站点迁到国外。来到了aws jp。\r\n\r\n我大致测了测，电信和移动的访问速度非常快，100ms以内，联通会慢一点，400ms以内吧。\r\n\r\n建议翻墙访问。', '服务器迁移至 aws 日本机房', '2018-11-09 15:04:17.979000', '0', '1', '4322', '2018-10-27 14:33:14.694000', '2018-10-27 14:33:14.694000', '0');
INSERT INTO `demo_topic` VALUES ('5ba5fd6237a6965f59051bd1', '4f447c2f0a8abae26e01b27d', 'share', '> 『大吉大利，明早吃蛋。』\r\n> \r\n> 底部有文化衫活动邀您参加。\r\n\r\n知乎原文地址：https://zhuanlan.zhihu.com/p/45143762\r\n\r\n![image.png](//static.cnodejs.org/FkV4SW_6zuURqOdHc0lalW7pC7Fv)\r\n\r\n2016 年 9 月，我们在 JSConf China 2016 上宣布了 Egg 开源，至今整整 2 年了。\r\n在 [Egg 2.0 发布通告](https://zhuanlan.zhihu.com/p/31640541) 提到，核心代码已经很稳定，__后续重心主要在开发者体验方面的优化。__\r\n\r\n> Egg 是阿里 Node.js 的核心基础框架，面向『企业级的 Web 基础框架』这个领域，提供了「微内核 + 插件机制 + 框架定制能力」，完美达成生态共建和差异化定制的平衡点。\r\n> \r\n> 既适合个人小项目快速开发，也适合团队架构师基于自身的技术架构在 Egg 基础上扩展出适合特定团队业务场景的框架。\r\n> \r\n> 它沉淀自阿里在各行各业不同领域的大规模工程实践经验，稳定支撑了多年天猫双11大促，顶级流量压力。\r\n\r\n\r\n接下来跟大家分享下，过去 9 个月里面，我们的一些产出和数据，本文较长，请慢慢品用：\r\n\r\n* __开发者数据分享__\r\n* __文化衫活动邀请__\r\n* __开发者体验优化__\r\n    * TypeScript 的支持\r\n    * 新增「生命周期」\r\n    * Alinode 接入指南\r\n    * 和 Java 的互联互通方案\r\n    * 实践案例 - 用 Egg 重构的 cnode 社区\r\n    * 来自语雀团队的 sequelize ORM 实践分享\r\n    * 与 Webpack 等前端工程的实践分享\r\n    * 错误处理和 opentracing 的 RFC\r\n    * egg-init 骨架重构方案\r\n* __未来规划__\r\n\r\n\r\n---\r\n\r\n## 开发者数据\r\n\r\n\r\n![image.png | left | 600x303](https://cdn.nlark.com/yuque/0/2018/png/84182/1537602757084-21ffa6c7-d95d-4da0-b48b-6312551d1b03.png \"\")\r\n\r\n\r\n* 官网 PV 在 1.2w 左右。\r\n* npm egg 模块数 1006 个，GitHub 依赖库 3738 个。\r\n* 一千多个 Pull Request，2200 个 Issue，130 多位 Contributors 。\r\n* 共发布了 81 个版本，[Release Note](https://github.com/eggjs/egg/releases) 。\r\n* 社区实践项目：[cnodejs/egg-cnode](https://github.com/cnodejs/egg-cnode) ，[eggjs/awesome-egg](https://github.com/eggjs/awesome-egg) 。\r\n* [知乎专栏 Node.js](https://zhuanlan.zhihu.com/eggjs) 一共发布了 48 篇文章，7600 订阅，阅读数据未知（知乎创作者中心看不上咱，不给内测资格 ?）。\r\n\r\n__正在使用 Egg 的公司，不完全统计：__\r\n\r\n* 深度使用的： 阿里巴巴，全民直播，网易考拉\r\n* 使用并有分享过使用经验的：去哪儿，摩拜，点评\r\n* 有个别团队咨询过试水但最终有没有落地的不知道：美团，新浪，百度，腾讯，YY 等\r\n\r\n__顺便分享一个 cnpm 的__[统计数据](https://fengmk2.com/npm-china-mirror-downloads?year=2018)__：__\r\n\r\n\r\n\r\n![image.png | left | 720x423](https://cdn.nlark.com/yuque/0/2018/png/84182/1537602856784-1517e844-15e1-495f-b58b-c5103a09b5a3.png \"\")\r\n\r\n\r\n\r\n\r\n![image.png | left | 720x413](https://cdn.nlark.com/yuque/0/2018/png/84182/1537602864083-a887fcab-8754-4ba6-90cb-eada7a3a477f.png \"\")\r\n\r\n\r\n\r\n---\r\n\r\n## 文化衫活动\r\n\r\n欢迎大家访问以下链接，分享你们的实践经验，有机会获得 Egg 文化衫和相关周边喔~\r\n另外，第 10000 Star 的同学 [godmeir](https://github.com/zhyjor) 请联系我们。\r\n\r\n[『2018 年 EggJS 怎么样了？对它的看法有什么变化？』](https://www.zhihu.com/question/273783655)\r\n\r\n\r\n\r\n\r\n![image.png | left | 600x800](https://cdn.nlark.com/yuque/0/2018/png/84182/1537602940849-da573bac-6899-47c1-ae18-e288e6d6fe79.png \"\")\r\n\r\n\r\n\r\n---\r\n\r\n## 开发者体验优化\r\n\r\n接下来跟大家分享下这段时间来，我们在『开发者体验』方面做的一些优化。\r\n\r\n### TypeScript\r\n\r\n这几年来 TypeScript 很受欢迎，它的静态类型检查，智能提示，IDE 友好性等特性，对于大规模企业级应用，是非常的有价值的，被视为是企业级 JS 开发的未来之一。\r\n\r\n阿里内部实践 TS 也蛮久了，在 5 个月前，也把我们的其中一部分成熟的实践，分享出来：\r\n[『天猪：当 Egg 遇到 TypeScript，收获茶叶蛋一枚』](https://zhuanlan.zhihu.com/p/35334932)\r\n\r\n\r\n非常感谢 @吖猩 在这领域的持续贡献：\r\n* [ts-node 下错误堆栈问题排查小记](https://zhuanlan.zhihu.com/p/43181384)\r\n* [Egg TS 改造总结](https://github.com/whxaxes/blog/issues/12)\r\n* [Typescript 在 Egg + Vue 应用中的实践](https://github.com/whxaxes/blog/issues/11) \r\n\r\n这块目前还在持续优化中，有兴趣的同学可以参与以下几项优化：\r\n\r\n* egg-ts-helper 增加对 js 的支持，这样非 ts 的同学，也能享受到智能提示和静态检查的 Buffer 加成。\r\n* 完善插件自带的 d.ts 方便其他开发者。\r\n* 分享你的上层封装，如通过装饰器来注册路由或 AOP。（内部有不少实践，但还未达成共识）\r\n\r\n> PS： Egg.js 本身不会使用 TypeScript 重写，对于框架本身而言，JS 的灵活性可以让它更容易实现一些特性，同时它也并没有那么复杂的业务逻辑，TypeScript 并无法给框架研发带来更多的帮助。\r\n\r\n### 生命周期\r\n\r\n之前 Egg 提供给开发者在启动期的钩子不多，只有 beforeStart 几个。\r\n感谢 killagu 同学给我们补充了更细致的生命周期，相关的 RFC 和文档如下：\r\n\r\n* [[RFC] egg-core 增加应用启动阶段 · Issue #2520 ](https://github.com/eggjs/egg/issues/2520#issuecomment-399008659)\r\n* [Egg 文档 - 生命周期](https://eggjs.app/zh-cn/advanced/loader.html#%E7%94%9F%E5%91%BD%E5%91%A8%E6%9C%9F)  （目前文档还有较大的优化空间，我们将在后续继续完善。）\r\n\r\n```javascript\r\n// app.js\r\nclass AppBootHook {\r\n  configDidLoad() {\r\n    // Config, Plugin files have did load.\r\n  }\r\n\r\n  async didLoad() {\r\n    // All files have did load, start plugin here.\r\n  }\r\n\r\n  async willReady() {\r\n    // All plugins have started, can do some thing before app ready.\r\n  }\r\n\r\n  async didReady() {\r\n    // Worker is ready, can do some things don\'t need to block the app boot.\r\n  }\r\n\r\n  async serverDidReady() {\r\n    // Server is listening.\r\n  }\r\n\r\n  async beforeClose() {\r\n    // Do some thing before app close.\r\n  }\r\n}\r\n```\r\n\r\n\r\n### Alinode\r\n\r\nNode 发展到今天，已经被越来越广泛地应用到前后端分离、全栈开发、客户端工具等领域。\r\n然而，相对于应用层的蓬勃发展，其 Runtime 对于绝大部分前端出身的开发者来说，处于黑盒的状态，这一点并没有得到很好的改善，从而也阻碍了 Node.js 在业务中的应用和推广。\r\n\r\n作为一个 Node 开发者，最头痛的事莫过于莫名其妙的 CPU 100% 和内存泄露导致的 OOM。\r\n\r\n所幸的是，阿里云 @朴灵 团队的 [Node.js 性能平台](https://www.aliyun.com/product/nodejs) 为 Node 开发者提供了：`性能监控、安全提醒、故障排查、性能优化` 等服务的整体性解决方案，提供完善的工具链和服务，协助开发者快速发现和定位线上问题。这些年来，为我们解决了非常多的线上问题，为业务保驾护航。\r\n\r\n相关分享：\r\n* [Node 案发现场揭秘 —— Coredump 还原线上异常](https://zhuanlan.zhihu.com/p/41178823)\r\n* [一行 delete require.cache 引发的内存泄漏血案](https://zhuanlan.zhihu.com/p/34702356)\r\n* [Egg 文档 - Alinode 一键接入](https://eggjs.app/zh-cn/core/deployment.html#nodejs-%E6%80%A7%E8%83%BD%E5%B9%B3%E5%8F%B0alinode)\r\n\r\n当然，在日常的答疑中，很多同学也表达了对数据安全方面的担忧。从我个人的角度来看，Alinode 的采集脚本，都是开源了，不会采集隐私数据。实在不行，在压测期接入用用也行，绝对可以让我们少掉一点头发，良心推荐。\r\n\r\n### 和 Java 互联互通的方案\r\n\r\nNode.js 在蚂蚁和阿里已经发展了四、五年时间，从最开始「前端工程师的玩具」，到 Web、BFF 场景的破局，逐步走到线上甚至是一些核心业务，非常不容易。\r\n\r\n回头想想 Nodejs 为什么能活下来？依靠的绝不仅仅是：非阻塞I/O、事件驱动、轻量这些官方宣传的特性，__我们认为更重要一点是我们打通了和 Java 的桥梁，实现了互联互通，这才让它真正融入阿里的技术体系。__\r\n\r\n伴随 [蚂蚁 SOFA Java 技术栈](https://www.cloud.alipay.com/products/SOFA) 的开源，我们也开源了 Nodejs RPC 相关模块，希望能填补 Nodejs 社区这块的空白，也将我们几年来在 Nodejs 基础技术的一些经验做个总结和分享。\r\n\r\n推荐阅读小丸子姐姐的相关科普文章：\r\n\r\n* [Eggjs 和 SOFA 的跨语言互调](https://zhuanlan.zhihu.com/p/38004479)\r\n* [聊聊 Node.js RPC（一）— 协议](https://zhuanlan.zhihu.com/p/38012481)\r\n* [聊聊 Node.js RPC（二）— 服务发现](https://zhuanlan.zhihu.com/p/40606909)\r\n\r\n### egg-cnode\r\n\r\n朴老师发起的 [cnodejs/egg-cnode](https://github.com/cnodejs/egg-cnode) 项目，用 Egg 重写了 cnode 社区应用。\r\n目前完成了功能层面的重构以及测试用例的补全：\r\n\r\n* 文件数减少 41，减少 22%\r\n* 代码行数减少 2460 行，减少 4.7%\r\n* 测试代码减少 980 行，减少 39%，覆盖率高于原项目。\r\n\r\n目前还有较大的优化空间，因为第一阶段专注于功能迁移，不做大的优化，有些使用方式不符合 Egg 的最佳实践，欢迎有兴趣的同学加入一起完善。\r\n\r\n### 值得关注的 RFC 和分享\r\n\r\n> 在 eggjs 团队的日常协作中，遵循「基于 GitLab 的硬盘式异步协作模式」。\r\n> 通过 [issue](https://github.com/eggjs/egg/issues) 发起 RFC 提案 -> 讨论定稿-> 提交 Pull Request -> Code Review -> 发布。\r\n> 这样便于沉淀，即使是当时没有参与讨论的开发者，事后也能通过 issue 了解某个功能设计的前因后果。\r\n\r\n__Θ 来自 __[语雀团队](https://www.yuque.com/)__ 的 ORM 实践分享__\r\n* 语雀是基于 Egg 技术栈研发的，算是为数不多的涉及到各个技术点的 Node 大应用。\r\n* [Egg 文档 - Sequelize](https://eggjs.app/zh-cn/tutorials/sequelize.html)\r\n\r\n__Θ 与 Webpack 等前端工程的实践分享__\r\n\r\n* [Egg 文档 - Assets 静态资源](https://eggjs.app/zh-cn/tutorials/assets.html)\r\n* 来自 [easywebpack](https://zhuanlan.zhihu.com/easywebpack) 的实践\r\n* 上层同构框架：[alibaba/beidou](https://github.com/alibaba/beidou) 和 [Serlina](https://zhuanlan.zhihu.com/p/41947819)\r\n\r\n__Θ 错误处理 && 问题跟踪__\r\n\r\n* [[RFC] egg-opentracing · Issue #39](https://github.com/eggjs/egg/issues/39)\r\n* [[RFC] 应用自定义 4xx 和 5xx 的方案 · Issue #1086](https://github.com/eggjs/egg/issues/1086)\r\n* [[RFC] 统计 egg 加载过程的各步骤的耗时 · Issue #1898](https://github.com/eggjs/egg/issues/1898#issuecomment-386823829)\r\n* [handle unconsume multipart request data in egg itself. · Issue #2897](https://github.com/eggjs/egg/issues/2897)\r\n\r\n__Θ 工具优化__\r\n目前的 egg-init 存在以下问题：\r\n\r\n* 脚手架逻辑集中化，全部在 egg-init 本身，作为全局命令，更新不方便。\r\n* 模板无法定制自己的逻辑，无法代码共享。\r\n* 没有 sub generator，如 egg-init add controller Test 这样的功能。\r\n* 脚手架只在项目初始化时用到，无法支撑升级功能，容易腐化和分裂。\r\n* 上层封装不方便，不支持 preset 。\r\n\r\n因此提出了 『[[RFC] egg-init refactor ](https://github.com/eggjs/egg/issues/2892)』，应该下个月可以完工并分享给大家。\r\n\r\n__Θ 科普文__\r\n提到 Egg 值得自豪的应该是我们的文档吧，我们深知前端开发者在后端知识面还有很多需要科普的，也很乐意分享我们的实践：\r\n\r\n[『专访死马：为什么说Egg.js是企业级Node框架』](https://zhuanlan.zhihu.com/p/36240171)\r\n\r\n\r\n* [科普文：运维不给升级 Node 版本怎么办？](https://zhuanlan.zhihu.com/p/39226941)\r\n* [科普文：为什么不能在服务器上 npm install ？](http://zhuanlan.zhihu.com/p/39209596)\r\n* [聊聊 Node.js RPC（一）— 协议](https://zhuanlan.zhihu.com/p/38012481)\r\n* [聊聊 Node.js RPC（二）— 服务发现](https://zhuanlan.zhihu.com/p/40606909)\r\n\r\n## 未来规划\r\n\r\n老实说没有太多新特性，还是那个原因：__Egg 采用的是『微内核 + 插件 + 上层框架』模式。__\r\n\r\nEgg 自身的迭代采取插件化的开发机制，功能分散在不同的模块中，可能开发者在使用时感知不到它的版本变更，但其实它一直都在进化。每周都可能有新特性和 BugFix 发布，更像是一个『改良派』而不是『改革派』，它会在兼容的前提下不断进化。\r\n\r\n接下来的规划，还将继续放在 __『开发者体验优化 + 实践经验分享』__ 方面。\r\n\r\n* egg cli 工具链和骨架的重构优化。\r\n* TypeScript 的继续优化，以及增加对 js 项目智能提示方面的支持。\r\n* 更多的实践项目和科普分享。\r\n* 国际化。\r\n\r\n仅凭我们自己的精力是远远不够的，欢迎社区的大家一起加入，共同推动 Node 的发展。\r\n\r\n## 写在最后\r\n\r\n* 如果你喜欢 Egg，请支持我们：\r\n* 分享本文，为我们点赞。\r\n* 来分享下你们的实践，无论大小，这很重要，谢谢，将有机会获得我们的文化衫。\r\n    \r\n[『2018 年 EggJS 怎么样了？对它的看法有什么变化？』](https://www.zhihu.com/question/273783655)\r\n\r\n\r\n* 如果喜欢我的文章，请关注 [我的知乎](https://www.zhihu.com/question/273783655) 和 [Follow GitHub](https://www.zhihu.com/question/273783655) 。\r\n* 广州阿里游戏，招前端，熟悉动效，Node 的速来~', 'EggJS 10000 Star + 2 years - 阿里 Node 企业级框架 ✨✨✨', '2018-11-08 04:10:56.714000', '1', '1', '9769', '2018-09-22 08:29:22.948000', '2018-09-22 08:29:22.948000', '0');
INSERT INTO `demo_topic` VALUES ('5baee8de9545eaf107b9c6f3', '51f0f267f4963ade0e08f503', 'share', '# Node.js 新生态\r\n\r\n关于 SSR、IoT、应用治理，以及来自腾讯的新物种 —— Tars.js，\r\n\r\n腾讯、ThoughtWorks、阿里巴巴的 4 位分享者，期待和你交流碰撞层出不穷的 Node.js 新应用场景。\r\n\r\n## Agenda\r\n\r\n![20180929110352.png](//static.cnodejs.org/FmVpEKuYsrXt8ek9z8d6DjFexMAc)\r\n\r\n时间：2018.10.13\r\n地点：深圳后海阿里中心\r\n报名链接: [https://survey.alibaba.com/survey/AgD9rVfQT](https://survey.alibaba.com/survey/AgD9rVfQT)\r\n活动主页: [http://nodejs.club/](http://nodejs.club/)\r\n\r\n注意: 沙龙场地有限，在报名链接中仔细填写「关注Node.js 新生态中的哪些具体问题」对最终挑选参加资格会有帮助。', 'Node 地下铁第七期「深圳站」线下沙龙邀约 - Node.js 新生态', '2018-11-01 12:53:15.077000', '0', '1', '5027', '2018-09-29 02:52:14.701000', '2018-09-29 02:52:14.701000', '0');
INSERT INTO `demo_topic` VALUES ('5b911f1837b3005a0b0e6c16', '55500f555809a4b66f37f625', 'share', '## 活动说明\r\n\r\n### 本次活动由蚂蚁金服-国际事业群-前端团队承办。\r\n\r\n> * 时间：2018 年 9 月 23 日 14:00 - 18:00\r\n> * 地点：浙大玉泉校区邵逸夫科学馆 117 会堂\r\n> * 报名链接：[https://www.bagevent.com/event/1843696](https://www.bagevent.com/event/1843696)\r\n> \r\n\r\n---\r\n\r\n\r\n## 活动的主题如下（包括PPT）：\r\n\r\n### 《DataHub2 - 你的最后一个 mock 方案》\r\nPPT：[download: DataHub.pdf](https://www.yuque.com/attachments/yuque/0/2018/pdf/95383/1537925050307-1fa501d9-b3fd-44c7-953b-8291d2c86ea8.pdf \"size:5046844\")\r\n\r\n分享时间：14:00 - 14:40\r\n\r\n主讲人介绍：张宇恒([@zhangyuheng](https://github.com/zhangyuheng)) - 蚂蚁国际高级前端工程师，[DataHub](https://github.com/macacajs/macaca-datahub) 核心开发，格言：To Be A Better Hacker 。\r\n\r\n\r\n\r\n![1536220954455-08024e18-182c-4e9c-8534-99ca63d0dd4b.png | left](//static.cnodejs.org/FuvmcnVJIRbF-xqcrJDFfiag0bSi \"\")\r\n\r\n\r\n内容：DataHub 是为解决复杂业务场景而诞生，但同时能够渐进式退化，为项目研发提供通用的 mock 解决方案。舒适的 Web 研发体验，从研发、测试、联调阶段贯穿始终的数据提供能力，剖析如何设计一个 mock 平台的核心理念和实践范式。从开发瓶颈和服务演进的角度讲述「__最后一个__」mock 方案。\r\n\r\n### 《蚂蚁国际前端工程体系》\r\n\r\n分享时间：14:50 - 15:30\r\n\r\n主讲人介绍：徐达峰([@xudafeng](https://github.com/xudafeng)) - 蚂蚁金服前端技术专家，阿里开源测试框架 [Macaca](https://github.com/alibaba/macaca) 作者，[autoresponsive-react](https://github.com/xudafeng/autoresponsive-react) 作者。\r\n\r\n\r\n\r\n![1536221094365-b2da0ffa-9103-478b-bd39-c8de3f06a0f2.png | left](//static.cnodejs.org/FgCUNY56nLYcXl7pXP1zaCIKNmOJ \"\")\r\n\r\n内容：介绍蚂蚁金服国际部门在国际化与本土化进程中遇到的挑战和成长。剖析中国技术出海的特点和如何快速构建合适的前端工程体系，也包括工具体系、持续交付、自动化测试等几个方向上的实践和思考。同时也会涉及 Macaca 技术生态的国际化成长。\r\n\r\n### 《Node.js 微服务实践》\r\nPPT：[download: Node.js 微服务实践.pdf](https://www.yuque.com/attachments/yuque/0/2018/pdf/95383/1537925145070-a192b890-1cbb-47da-bd4d-842671ceac98.pdf \"size:5178626\")\r\n\r\n分享时间：15:40 - 16:20\r\n\r\n主讲人介绍：高晓晨([@gxcsoccer](https://github.com/gxcsoccer)) - 蚂蚁金服前端技术专家，企业级 Web 框架应用框架 [Egg.js](https://github.com/eggjs) 核心成员，[sofa-rpc-node](https://github.com/alipay/sofa-rpc-node) 作者。\r\n\r\n\r\n\r\n![1536222500407-c710cca5-36d4-4685-a9d2-ba34163c39ff.png | left](//static.cnodejs.org/Fk0AYqZmVT5QmcnpFKO8AKCGjM-l \"\")\r\n\r\n内容：介绍金服如何用 Node.js 来实现微服务，包括 RPC 原理、服务发现、负载均衡等话题。同时会介绍一下如何使用和扩展我们开源的 [sofa-rpc-node](https://github.com/alipay/sofa-rpc-node) 项目来帮助外部实现 RPC，为系统架构带来新活力。\r\n\r\n### 《GraphQL 生态介绍》\r\n\r\nPPT：[download: GraphQL.pdf](https://www.yuque.com/attachments/yuque/0/2018/pdf/95383/1537925158919-2cd3bd39-31bd-4377-b347-33213489cde2.pdf \"size:4043353\")\r\n\r\n分享时间：16:30 - 17:10\r\n\r\n主讲人介绍：张开宇([@zhangkaiyulw](https://github.com/zhangkaiyulw)) - 前 Oracle 北京，香港 Beecrazy 员工。Ruby on Rails 贡献者之一。在后端，前端，移动端，以及 React Native 开发上，有丰富的经验。曾尝试将 iOS 系统的 Cocoa Touch API 风格移植到 HTML 网页中，并开发了基于其的一款国际象棋应用。有丰富大量的开源代码。\r\n\r\n\r\n\r\n![1536220909272-71b9e8f9-1665-4b84-85a0-26d686b8a7c5.png | left](//static.cnodejs.org/Fln08dUMEWfnEFwd4gmpC8QJJP9O \"\")\r\n\r\n\r\n内容：本次演讲介绍实现GraphQL API的工具，包括 apollo-server、merge-graphql-schemas、graphql-middleware、amur 脚手架工具以及他们的用法。并五分钟内演示带有上传功能，混合字段类型的，带有数据关联的复杂系统的 API。\r\n\r\n### 《 Megalo - 考拉的小程序解决方案》\r\n\r\nPPT：[download: megalo-考拉的小程序解决方案.pdf](https://www.yuque.com/attachments/yuque/0/2018/pdf/95383/1537925172399-4ed1c6cc-479e-4e4a-b537-0b4353da8198.pdf \"size:1943122\")\r\n\r\n分享时间：17:20 - 18:00\r\n\r\n主讲人介绍：网易考拉前端工程师，吴子然[@elcarim](https://github.com/elcarim5efil)，[mpregular](https://github.com/kaola-fed/mpregular)、[megalo](https://github.com/kaola-fed/megalo) 核心开发。\r\n\r\n\r\n\r\n![网易考拉_吴子然.jpeg | left](//static.cnodejs.org/Fh_VjuoZMUe_g5Tof53qU1iZ-wh_ \"\")\r\n\r\n内容：介绍考拉的小程序框架发展历程，我们是如何在现有框架上做改造，在小程序上支持更多的 Vue 特性，让跨端开发变得更简单。\r\n\r\n\r\n---\r\n\r\n\r\n## 现场照片\r\n\r\n\r\n\r\n![image.png | left | 827x272](https://cdn.nlark.com/yuque/0/2018/png/95383/1537924550598-bf24d186-3ff1-494d-a4f2-3702fac3aa6a.png \"\")\r\n\r\n\r\n\r\n\r\n![image.png | left | 827x257](https://cdn.nlark.com/yuque/0/2018/png/95383/1537924563365-f723e300-5223-4fc4-8751-416c98b9afd3.png \"\")\r\n\r\n\r\n\r\n\r\n![image.png | left | 827x620](https://cdn.nlark.com/yuque/0/2018/png/95383/1537924608159-042af9f1-0880-4003-a3ec-2697cf38bf18.png \"\")\r\n\r\n\r\n\r\n\r\n![image.png | left | 827x620](https://cdn.nlark.com/yuque/0/2018/png/95383/1537924578426-21656c2f-8b66-4452-915d-51b3320fbabb.png \"\")\r\n\r\n\r\n\r\n\r\n![image.png | left | 827x620](https://cdn.nlark.com/yuque/0/2018/png/95383/1537924629304-e8547f9d-2bed-4b1c-bf50-cfbdd52f9d8e.png \"\")\r\n\r\n\r\n\r\n\r\n![image.png | left | 827x602](https://cdn.nlark.com/yuque/0/2018/png/95383/1537926665393-17bb8bbb-d585-4bc9-a7cc-80cad0d6596f.png \"\")\r\n\r\n\r\n\r\n\r\n![image.png | left | 827x620](https://cdn.nlark.com/yuque/0/2018/png/95383/1537924638476-713a60a3-43d9-4261-9f2e-672e4cf4487d.png \"\")\r\n\r\n\r\n\r\n\r\n![image.png | left | 827x615](https://cdn.nlark.com/yuque/0/2018/png/95383/1537924701018-cd3800f5-3940-4877-844c-29b7f1015e37.png \"\")\r\n\r\n\r\n\r\n\r\n![image.png | left | 827x606](https://cdn.nlark.com/yuque/0/2018/png/95383/1537926870402-15f18f5d-dbe9-4faf-a1b6-301e7fe5fe67.png \"\")\r\n\r\n\r\n\r\n\r\n\r\n![image.png | left | 827x604](https://cdn.nlark.com/yuque/0/2018/png/95383/1537926843721-002a0b79-235d-456e-8daf-5f3fde47b5b0.png \"\")\r\n\r\n\r\n\r\n\r\n\r\n\r\n![image.png | left | 827x607](https://cdn.nlark.com/yuque/0/2018/png/95383/1537925309980-a2262bf0-d3e6-4152-8150-1c8487cfda69.png \"\")\r\n\r\n\r\n### 特别感谢浙大软件学院对本次活动提供场地支持！\r\n\r\n\r\n---\r\n\r\n\r\n## 关于 NodeParty\r\n\r\n\r\n\r\n![image | center](https://cdn.nlark.com/yuque/0/2018/png/95383/1536228236464-a496d8a0-4862-4946-af56-b55fb7c68af3.png \"\")\r\n\r\n\r\nNodeParty 品牌诞生于 CNode 社区，杭州 NodeParty 是由大搜车（Souche Inc.）发起的一个面向 Node.js 爱好者的技术分享聚会，希望能够构建一个持续的分享学习的平台，一起发展 Node.js 生态。', '第七期杭州 Node Party 回顾【附PPT】', '2018-10-17 07:50:19.775000', '0', '1', '10013', '2018-09-06 12:35:36.197000', '2018-09-06 12:35:36.197000', '0');
