INSERT INTO `demo_topic` VALUES ('5be29f7c21d75b74609f4fbf', '5bda8a7793f8d64f74b012ae', 'share', '原文链接：https://www.jianshu.com/p/57e5bb1277ce\r\n\r\n# 前言\r\n**注意：上 HTTPS 超级简单，写这么多，只是因为过程比较有趣，就多哆嗦了几句**\r\n有了自己的博客：[《极简博客搭建，搭建超级简单又好看》](https://www.jianshu.com/p/527583637f17)\r\n有了自己的图片处理服务：[《搭建自己的图片处理服务 — 智能裁剪、旋转、占位一站搞定》](https://www.jianshu.com/p/b4db00f73ab5)\r\n都已经这么完美了，为什么还会有这篇文章呢？是对社会有什么不满意吗？\r\n![HTTPS](https://upload-images.jianshu.io/upload_images/14752545-5ed58920c69d79de.png?imageMogr2/auto-orient/strip%7CimageView2/2/w/1240)\r\n\r\n# 为什么要上 HTTPS\r\n**安全：**你与用户之间的消息加密传输，防止中间人攻击(**就是我遇到的问题**)\r\n**其它优点：**当你在国内使用域名时，需要备案。有时你想测试一下你的站，用上未备案的域名，怎么办呢？https 可以帮你暂时绕过阿里云弹的未备案页(**强烈建议去备案你的域名，一来你应当守法，二来未备案国内 cdn、网站收录什么的都需要备案的域名**)，其它暂时没想到有什么优点。\r\n\r\n# 因果\r\n前些天刚搭了个漂亮的小博客，写了几篇小日记还没有修改成小说。可以说非常开心了，于是今天早早洗完澡准备在床上用手机体验下网站自适应的效果。打开微信，扫了下自己站的二维码，顺势躺在床上。划～划～划，突然底部跳出一个广告，咦？什么情况？我什么时候投的广告？？这博客不会这么坑吧？竟然自带广告。\r\n不行，得起来撸代码了。带着懊恼的心情，我又回到了电脑前，开始检查博客的源码，看看具体哪里出了这个问题。看了一遍，没有问题。突然想到，这可能是被运营商劫持了。那没办法了，只能连夜上个 HTTPS 了。\r\n\r\n [没有服务器？ 来参加阿里云双 11 底价团，12 号前 99.5/台起！](https://m.aliyun.com/act/team1111/#/share?params=N.9g4CZ2TwSh.n2wswqow)\r\n>![优惠的一小部分](https://upload-images.jianshu.io/upload_images/14752545-847853f809e2593f.png?imageMogr2/auto-orient/strip%7CimageView2/2/w/1240)\r\n>[查看更多](https://m.aliyun.com/act/team1111/#/share?params=N.9g4CZ2TwSh.n2wswqow)\r\n\r\n# 准备\r\n* 域名（自备）\r\n* [acme.sh](http://acme.sh/)\r\nacme.sh 是一个自动申请 https 证书的脚本，使用方便，功能也非常强大。\r\n**安装：**\r\n```curl https://get.acme.sh | sh```\r\n或者\r\n ```wget -O -  https://get.acme.sh | sh```\r\n这样你已经把 acme.sh 这个小工具安装到你本地的 ```~/.acme.sh/```中了，而不会在你系统的其它地方装些乱七八糟的东西。\r\n\r\n# 极速开始\r\n**不是阿里的朋友，可以尝试下面的常规路线**\r\n阿里云购买域名的朋友可以走这个极速通道，因为阿里云有接口可以直接操作域名控制台，这个接口已经被整合到了 ```acme.sh``` 这个工具里面。只要设置一下 Ali_Key 和 Ali_Secret， [从哪里获得？](https://ak-console.aliyun.com/#/accesskey)\r\n\r\n1. 在你的命令行中执行如下命令：\r\n```export Ali_Key=\"换成你的 AccessKey ID\"```\r\n```export Ali_Secret=\"换成你的 Access Key Secret\"```\r\n\r\n2. 开始申请证书\r\n```acme.sh --issue --dns dns_ali -d 2td.cc -d \'*.2td.cc\'``` \r\n```2td.cc``` 是我的域名，这里需要换成你的。\r\n**参数解释:**\r\n**acme.sh** ：表示使用你刚安装好的acme.sh\r\n**--issue** ：申请证书\r\n**--dns dns_ali**：使用阿里云的 dns 服务，在阿里云买的域名，在没有修改默认 dns 的前提下，都可以使用这个参数来申请 https 证书。\r\n**-d 2td.cc**：```-d```表示 domain，后面跟你要申请域名。\r\n__-d \'*.2td.cc\'__：这里的-d 与上方一样，-d 参数可以带多个，这里的```\'*.2td.cc\'```中的 * 表示泛域名，只要申请了这个证书像（www.2td.cc，mail.2td.cc，h5.2td.cc ...）这类的二级域名都可以使用此证书来实现 https。**注意** ```2td.cc```这个域名不在这条规则里，所以上面又加了一条```-d 2td.cc```，这样你的主域名、二级子域名均可以使用此证书。\r\n\r\n3. 等待执行完成，期间会有 120 秒的倒计时，结束后如果显示成功，则证书申请成功。\r\n>![申请中...](https://upload-images.jianshu.io/upload_images/14752545-8e43c8865ca7cb4e.png?imageMogr2/auto-orient/strip%7CimageView2/2/w/1240)\r\n![申请完成](https://upload-images.jianshu.io/upload_images/14752545-05c94c2d6816d703.png?imageMogr2/auto-orient/strip%7CimageView2/2/w/1240)\r\n![申请好的证书路径](https://upload-images.jianshu.io/upload_images/14752545-55ca990b32e2e208.png?imageMogr2/auto-orient/strip%7CimageView2/2/w/1240)\r\n\r\n4. 应用到 nginx\r\n修改你 nginx 的配置，配置 https\r\n```\r\nserver {\r\n    listen 443 ssl;\r\n    # 有了 https 可以尝试开启 http2，加速你的网站 \r\n    # http2 需要你 nginx 加载了 http2 模块，用如下配置开启。\r\n    # listen 443 ssl http2;\r\n    server_name 2td.cc;\r\n\r\n    ssl_certificate /root/.acme.sh/2td.cc/fullchain.cer;\r\n    ssl_certificate_key /root/.acme.sh/2td.cc/2td.cc.key;\r\n\r\n    # charset koi8-r;\r\n    access_log  /var/log/nginx/host.access.log  main;\r\n    \r\n    # 下面写你之前的配置\r\n}\r\n```\r\n\r\n# 常规路线\r\n一些 DNS 服务商，没有提供 API 操作 DNS 的接口，所以整合不进这个工具里。当然我们也还是可以申请证书。\r\n这种方式的好处是, 你不需要任何服务器, 不需要任何公网 ip, 只需要 dns 的解析记录即可完成验证. 坏处是，如果不同时配置 [Automatic DNS API](https://github.com/Neilpang/acme.sh/blob/4f59a821d33281ff5a3090cbe8de47c5f0ae10ce/dnsapi/README.md)，使用这种方式 acme.sh 将无法自动更新证书，每次都需要手动再次重新解析验证域名所有权。\r\n1. 申请证书\r\n```acme.sh  --issue  --dns -d aiwdh.cn --yes-I-know-dns-manual-mode-enough-go-ahead-please```\r\n```aiwdh.cn``` 是我的域名，这里需要换成你的。\r\n**参数解释:**\r\n**acme.sh** ：表示使用你刚安装好的acme.sh\r\n**--issue** ：申请证书\r\n**--dns**：使用 DNS 的方式来验证你的所有权，你需要在域名上添加一条 txt 解析记录, 验证域名所有权。\r\n**-d aiwdh.cn**：```-d```表示 domain，后面跟你要申请域名。\r\n**--yes-I-know-dns-manual-mode-enough-go-ahead-please**:官方不推荐使用此方式来生成证书，所以有这个额外的参数来提醒你你在做什么。\r\n![申请证书](https://upload-images.jianshu.io/upload_images/14752545-a1de100dc33f1816.png?imageMogr2/auto-orient/strip%7CimageView2/2/w/1240)\r\n\r\n\r\n2. 添加 txt 记录\r\n![添加 txt 记录](https://upload-images.jianshu.io/upload_images/14752545-70a292fa43dadd6a.png?imageMogr2/auto-orient/strip%7CimageView2/2/w/1240)\r\n\r\n3. 加好记录后，重新申请证书\r\n```acme.sh  --issue  --dns -d aiwdh.cn --yes-I-know-dns-manual-mode-enough-go-ahead-please --renew```\r\n![重新申请证书](https://upload-images.jianshu.io/upload_images/14752545-8be6488b3e4f5a0d.png?imageMogr2/auto-orient/strip%7CimageView2/2/w/1240)\r\n![申请好的证书路径](https://upload-images.jianshu.io/upload_images/14752545-aa7e33473e41c18b.png?imageMogr2/auto-orient/strip%7CimageView2/2/w/1240)\r\n4. 应用到 nginx\r\n修改你 nginx 的配置，配置 https\r\n```\r\nserver {\r\n    listen 443 ssl;\r\n    # 有了 https 可以尝试开启 http2，加速你的网站 \r\n    # http2 需要你 nginx 加载了 http2 模块，用如下配置开启。\r\n    # listen 443 ssl http2;\r\n    server_name aiwdh.cn;\r\n\r\n    ssl_certificate /root/.acme.sh/aiwdh.cn/fullchain.cer;\r\n    ssl_certificate_key /root/.acme.sh/aiwdh.cn/aiwdh.cn.key;\r\n\r\n    # charset koi8-r;\r\n    access_log  /var/log/nginx/host.access.log  main;\r\n    \r\n    # 下面写你之前的配置\r\n}\r\n```\r\n5. 这种方式添加的证书，每当证书快过期，需要重新走一下这些步骤，稍微麻烦一点。\r\n\r\n# 结语\r\n如果用极速申请的方式，很快就可以实现全站 https 了。当然第二种方式来申请证书你都不需要在自己的服务器上作操作，你可以在本地完成申请，把证书拿到各个地方去用。\r\n\r\n终于用上了 https, 再也没有多余的广告在我手机上显示了，开心。申请速度倒是很快，整理不易，且行且珍惜。\r\n[还没服务器域名？ 来参加阿里云双 11 底价团，12 号前 99.5/台起！](https://m.aliyun.com/act/team1111/#/share?params=N.9g4CZ2TwSh.n2wswqow)', '轻松全站 HTTPS，还没用上 https (可申请泛域名证书)的朋友可以操练起来了', '2018-11-12 05:48:13.602000', '0', '0', '937', '2018-11-07 08:17:00.617000', '2018-11-07 08:17:00.617000', '0');
INSERT INTO `demo_topic` VALUES ('5be911b6e161dc409d760b96', '5639e5516d966e1a39996b1a', 'share', '![image](https://github.com/leinov/awesome-web-you-should-know/raw/master/img/logo2.png)\r\n[github 持续更新](https://github.com/leinov/awesome-web-you-should-know)\r\n\r\n## ? awesome-web-you-should-know\r\n\r\n\r\n#### ?tool\r\n\r\n* [emoji homepage](http://emojihomepage.com/) (emoji表情)\r\n* [json editor online](http://jsoneditoronline.org/) (在线json格式转换)\r\n* [processOn](https://processon.com/;jsessionid=240B6EBC172A590374E213A3701132C2.jvm1) (流程图)\r\n* [tiny png](https://tinypng.com/) (图片压缩)\r\n* [youtube视频下载](https://www.onlinevideoconverter.com/youtube-converter) (只需一个网页链接就可下载各大视频网站视频)\r\n* [在线二维码生成](http://www.liantu.com/)\r\n* [Alexa](https://www.alexa.com/topsites) (网站全球排名)\r\n* [在线查询](https://www.supfree.net/) (很牛逼)\r\n* [the-numbers](https://www.the-numbers.com/) (电影全球票房查询)\r\n\r\n#### ?技术&论坛\r\n\r\n* [github](https://github.com/) (全球最大代码托管社区)\r\n* [stackoverflow](https://stackoverflow.com/) (全球最大技术问答社区)\r\n* [codrops](https://tympanus.net/codrops/) (大量优秀页面效果)\r\n* [reddit](https://www.reddit.com/) (最优秀的论坛)\r\n* [medium](https://medium.com/) (各类优秀文章)\r\n* [v2ex](https://www.v2ex.com/) (用过的都说好)\r\n* [segmentfault](https://segmentfault.com/news) (思否 优秀)\r\n* [node中文社区](https://cnodejs.org/)(Node.js专业中文社区)\r\n* [博客园](https://www.cnblogs.com/leinov) (代码改变世界)\r\n* [CSDN](https://blog.csdn.net/)\r\n* [掘金](https://juejin.im) (开发者成长社区)\r\n* [infoQ](http://www.infoq.com)\r\n* [伯乐在线](http://blog.jobbole.com/)\r\n* [微信开放社区](https://developers.weixin.qq.com/community)\r\n* [react中文论坛](http://react-china.org/)\r\n* [vue论坛](https://forum.vuejs.org/top/all)\r\n\r\n#### ?设计&绘画类\r\n\r\n* [dribbble](https://dribbble.com/) (最优秀的ui设计网站)\r\n* [Behance](https://www.behance.net/) (最优秀的平面设计网站)\r\n* [adobe color](https://kuler.adobe.com/explore/newest/) (adobe 色盘)\r\n* [google design](http://www.google.com/design/) (谷歌设计)\r\n* [artstation](https://www.artstation.com/) (大量优秀原画)\r\n* [deviantart](https://www.deviantart.com/) (牛逼原画)\r\n* [colrd](http://colrd.com/) (色彩搭配)\r\n* [dryicons](https://dryicons.com/) (大量icon)\r\n* [UI中国](http://www.ui.cn/) (专业用户体验设计平台)\r\n* [站酷](http://www.zcool.com.cn/) (设计师互动平台 大神很多)\r\n* [UI图](http://www.uiimg.com/) (UI设计)\r\n* [UI8](https://ui8.net/)(UI设计)\r\n* [阿里巴巴矢量图标库](http://www.iconfont.cn/) (大量优秀icon)\r\n\r\n#### ?云课堂\r\n\r\n* [网易云课堂](http://study.163.com/)\r\n* [慕课网](http://www.imooc.com/)\r\n* [极客学院](http://www.jikexueyuan.com/)\r\n* [极客时间](https://time.geekbang.org/) (收费技术干货)\r\n* [三节课](https://www.sanjieke.cn) (产品运营收费干货)\r\n* [麦子学院](http://www.maiziedu.com/)\r\n* [北风网](http://www.ibeifeng.com/)\r\n* [好知网](http://www.howzhi.com/)\r\n* [codecademy](http://www.codecademy.com/learn)\r\n* [pluralsight](https://www.pluralsight.com/)\r\n\r\n#### ?区块链\r\n\r\n* [火币](https://www.huobi.com/) (交易)\r\n* [巴比特](http://www.8btc.com/) (社区)\r\n* [非小号](https://www.feixiaohao.com/) (社区 全球排名)\r\n* [币乎](https://bihu.com/) (文章社区)\r\n* [迷恋猫](https://www.cryptokitties.co/)\r\n* [龙币](https://dragonex.im/zh-hans/trade/index/btc_usdt) (我就是在这上面买币的)\r\n\r\n#### ⛷ 优秀个人&组织博客\r\n\r\n* [阮一峰老师](http://www.ruanyifeng.com/blog/) (神)\r\n* [廖雪峰](https://www.liaoxuefeng.com/) (无所不通)\r\n* [腾讯全端技术团队](http://www.alloyteam.com/)\r\n* [阿里UED](http://www.aliued.cn/)\r\n* [美团技术团队](https://tech.meituan.com/)\r\n* [360奇舞团](https://75team.com/) (360大前端团队)\r\n* [粉丝日志](http://blog.fens.me/series-nodejs/)\r\n* [helloweta](https://www.helloweba.net/)', 'awesome-web-you-should-know', '2018-11-12 05:37:58.723000', '0', '0', '75', '2018-11-12 05:37:58.723000', '2018-11-12 05:37:58.723000', '0');
