INSERT INTO `demo_topic` VALUES ('5b3e2e8c35342ab069061298', '587599e6e65101c634fc9644', 'ask', '子系统的注销按钮，是跳转到 SSO 的注销接口地址， 然后 SSO 清除cookie,然后 通知（发送 http 请求）给子系统清除 session。 \r\n\r\n但是当重新刷新子系统页面的时候，session 还是存在的， 尴尬， \r\n\r\n注销的代码如下， 求大佬指教\r\n\r\n![image.png](//static.cnodejs.org/FtvN5XV0m3kTGWYgB28Lpnob8kqh)\r\n\r\n![image.png](//static.cnodejs.org/FqLzwoaM1NA9DC9w4n_WKfxjGG67)', '关于 SSO 单点注销， SSO如何通知子系统清除凭证？', '2018-11-12 03:51:01.646000', '0', '0', '1409', '2018-07-05 14:43:24.397000', '2018-07-05 14:43:24.397000', '0');
INSERT INTO `demo_topic` VALUES ('5be8f13ae161dc409d760acb', '51ece401f4963ade0e95513a', 'share', '> 本篇主要是对`uv_prepare_t`句柄的介绍\r\n\r\n## uv_prepare_t声明\r\n还是从[uv.h](https://github.com/nodejs/node/blob/master/deps/uv/include/uv.h#L754)切入，便能找到关于`uv_prepare_t`的声明：\r\n```c\r\nstruct uv_prepare_s {\r\n  UV_HANDLE_FIELDS\r\n  UV_PREPARE_PRIVATE_FIELDS\r\n};\r\n```\r\n其中的私有宏`UV_PREPARE_PRIVATE_FIELDS`展开如下：\r\n```c\r\n#define UV_PREPARE_PRIVATE_FIELDS                                             \\\r\n  uv_prepare_cb prepare_cb;                                                   \\\r\n  void* queue[2];                                                             \\\r\n```\r\n`uv_prepare_t`可谓是中规中矩了，只有一个回调，以及一个句柄队列指针。而这个句柄为何起名叫prepare，则是因为`uv__run_prepare`会在`uv__io_poll`阻塞进程之前运行。\r\n\r\n## prepare 相关api\r\n视线转移到[loop-watche.c](https://github.com/nodejs/node/blob/master/deps/uv/src/unix/loop-watcher.c#L66)中：\r\n```c\r\nUV_LOOP_WATCHER_DEFINE(prepare, PREPARE)\r\n```\r\n把这个宏展开如下：\r\n```c\r\n#define UV_LOOP_WATCHER_DEFINE(name, type)                                    \\\r\n  int uv_##name##_init(uv_loop_t* loop, uv_##name##_t* handle) {              \\\r\n    uv__handle_init(loop, (uv_handle_t*)handle, UV_##type);                   \\\r\n    handle->name##_cb = NULL;                                                 \\\r\n    return 0;                                                                 \\\r\n  }                                                                           \\\r\n                                                                              \\\r\n  int uv_##name##_start(uv_##name##_t* handle, uv_##name##_cb cb) {           \\\r\n    if (uv__is_active(handle)) return 0;                                      \\\r\n    if (cb == NULL) return UV_EINVAL;                                         \\\r\n    QUEUE_INSERT_HEAD(&handle->loop->name##_handles, &handle->queue);         \\\r\n    handle->name##_cb = cb;                                                   \\\r\n    uv__handle_start(handle);                                                 \\\r\n    return 0;                                                                 \\\r\n  }                                                                           \\\r\n                                                                              \\\r\n  int uv_##name##_stop(uv_##name##_t* handle) {                               \\\r\n    if (!uv__is_active(handle)) return 0;                                     \\\r\n    QUEUE_REMOVE(&handle->queue);                                             \\\r\n    uv__handle_stop(handle);                                                  \\\r\n    return 0;                                                                 \\\r\n  }                                                                           \\\r\n                                                                              \\\r\n  void uv__run_##name(uv_loop_t* loop) {                                      \\\r\n    uv_##name##_t* h;                                                         \\\r\n    QUEUE queue;                                                              \\\r\n    QUEUE* q;                                                                 \\\r\n    QUEUE_MOVE(&loop->name##_handles, &queue);                                \\\r\n    while (!QUEUE_EMPTY(&queue)) {                                            \\\r\n      q = QUEUE_HEAD(&queue);                                                 \\\r\n      h = QUEUE_DATA(q, uv_##name##_t, queue);                                \\\r\n      QUEUE_REMOVE(q);                                                        \\\r\n      QUEUE_INSERT_TAIL(&loop->name##_handles, q);                            \\\r\n      h->name##_cb(h);                                                        \\\r\n    }                                                                         \\\r\n  }                                                                           \\\r\n                                                                              \\\r\n  void uv__##name##_close(uv_##name##_t* handle) {                            \\\r\n    uv_##name##_stop(handle);                                                 \\\r\n  }\r\n```\r\n可以看出，这个宏模板提供了几个方法，分别为：init、start、stop、close以及run。\r\n- init: 初始化句柄，并设置句柄回调为空\r\n- start: 修改句柄状态为活跃状态，其中`uv__handle_start`宏展开如下：\r\n```c\r\n// node/blob/master/deps/uv/src/uv-common.h\r\n\r\n#define uv__handle_start(h)                                                   \\\r\n  do {                                                                        \\\r\n    if (((h)->flags & UV_HANDLE_ACTIVE) != 0) break;                          \\\r\n    (h)->flags |= UV_HANDLE_ACTIVE;                                           \\  // 设置为活跃句柄\r\n    if (((h)->flags & UV_HANDLE_REF) != 0) uv__active_handle_add(h);          \\ // 活跃句柄计数+1\r\n  }                                                                           \\\r\n  while (0)\r\n```\r\n- run: 供事件循环(`uv_run`)调用以触发回调函数运行，在这里需要注意一点：\r\n```c\r\n      QUEUE_REMOVE(q);                                                        \\\r\n      QUEUE_INSERT_TAIL(&loop->name##_handles, q);                            \\\r\n```\r\n在句柄队列执行了`QUEUE_REMOVE`之后，队列中的句柄并没有真正被移除，而是又通过`QUEUE_INSERT_TAIL`插入到了队尾，意即**运行`loop-watcher`句柄(`uv_prepare_t`/`uv_check_t`/`uv_idle_t`)并不会清除句柄队列**\r\n- stop: 修改句柄状态为停止状态，其中`uv__handle_stop`宏展开如下：\r\n```c\r\n// node/blob/master/deps/uv/src/uv-common.h\r\n\r\n#define uv__handle_stop(h)                                                    \\\r\n  do {                                                                        \\\r\n    if (((h)->flags & UV_HANDLE_ACTIVE) == 0) break;                          \\\r\n    (h)->flags &= ~UV_HANDLE_ACTIVE;                                          \\ // 设置为非活跃句柄\r\n    if (((h)->flags & UV_HANDLE_REF) != 0) uv__active_handle_rm(h);           \\ // 活跃句柄计数-1\r\n  }                                                                           \\\r\n  while (0)\r\n```\r\n- close：关闭句柄。通过`uv_prepare_stop`实现\r\n\r\n## loop-watcher 事件循环监视器句柄\r\n通过`uv_prepare_t`我们可以引入一个概念：事件循环监视器。这些监视器有一个共性就是：**运行完成后不会清除句柄队列**。这里的监视器指的是`loop-watcher`中定义的句柄：\r\n```c\r\nUV_LOOP_WATCHER_DEFINE(prepare, PREPARE)\r\nUV_LOOP_WATCHER_DEFINE(check, CHECK)\r\nUV_LOOP_WATCHER_DEFINE(idle, IDLE)\r\n```\r\n即：`uv_prepare_t`/`uv_check_t`/`uv_idle_t`。  \r\n\r\n## node中对uv_prepare_t的应用\r\n在[env.cc](https://github.com/nodejs/node/blob/master/src/env.cc#L385)中，可发现如下代码：\r\n```c++\r\nvoid Environment::StartProfilerIdleNotifier() {\r\n  if (profiler_idle_notifier_started_)\r\n    return;\r\n\r\n  profiler_idle_notifier_started_ = true;\r\n\r\n  uv_prepare_start(&idle_prepare_handle_, [](uv_prepare_t* handle) {\r\n    Environment* env = ContainerOf(&Environment::idle_prepare_handle_, handle);\r\n    env->isolate()->SetIdle(true);\r\n  });\r\n\r\n  uv_check_start(&idle_check_handle_, [](uv_check_t* handle) {\r\n    Environment* env = ContainerOf(&Environment::idle_check_handle_, handle);\r\n    env->isolate()->SetIdle(false);\r\n  });\r\n}\r\n```\r\n其中的`uv_prepare_start`真正唤醒了prepare handle，node通过libuv的prepare句柄注册`SetIdle`，下面是`SetIdle`的源码：\r\n```c++\r\nvoid Isolate::SetIdle(bool is_idle) {\r\n  if (!is_profiling()) return;\r\n  StateTag state = current_vm_state();\r\n  DCHECK(state == EXTERNAL || state == IDLE);\r\n  if (js_entry_sp() != kNullAddress) return;\r\n  if (is_idle) {\r\n    set_current_vm_state(IDLE);\r\n  } else if (state == IDLE) {\r\n    set_current_vm_state(EXTERNAL);\r\n  }\r\n}\r\n```\r\n结合上面代码的`profiler_idle_notifier_started_`。可以发现，node在event-loop的`uv_run_prepare`阶段来通知此时vm(v8)的状态。 \r\n\r\n\r\n\r\n原文地址：[https://github.com/xtx1130/blog/issues/33](https://github.com/xtx1130/blog/issues/33)， 如果文中有误，还请大神斧正\r\nby 小菜', 'libuv源码粗读（4）：uv_prepare_t预处理句柄结构体介绍', '2018-11-12 03:19:22.156000', '0', '0', '91', '2018-11-12 03:19:22.156000', '2018-11-12 03:19:22.156000', '0');
INSERT INTO `demo_topic` VALUES ('5be8ee432fed25406c25d8f2', '5639e5516d966e1a39996b1a', 'share', 'https://github.com/leinov/node-weixin-api', 'Nodejs微信公众号开发', '2018-11-12 03:06:43.197000', '0', '0', '149', '2018-11-12 03:06:43.197000', '2018-11-12 03:06:43.197000', '0');
INSERT INTO `demo_topic` VALUES ('5be8eb2d2fed25406c25d8a2', '5be8e9ef2fed25406c25d88c', 'share', '最近看了 mv shelter，心里迟迟不能平静。\r\n痛苦，孤寂，绝望..\r\n好的剧情真的可以震撼心灵！突然有了强烈的创作欲望！\r\n身为程序员，当然选择在命令行上跳舞，命令行上的幻想世界...互动小说!\r\n\r\n于是先 lu 出来了一个框架: cmd-alive\r\n\r\n## Usage\r\n```\r\n  npm i -g alive\r\n```\r\n// 默认打开 demo。自动从上次进度开始。\r\n```\r\n  alive\r\n```\r\n命令:\r\n* save: 保存进度\r\n* restart: 重新开始\r\n\r\n## 面向小说作者（ opitional ）\r\n\r\n\r\n\r\n两种文件是必须的 .js, .ca.\r\n\r\n* .ca：小说内容，每一节要有 label 标识. 必须包括start, end label\r\n\r\n* .js：流程控制，js 函数， 函数名和返回值必须是 label。可以访问全局对象 ctx，用来获取当前用户输入，过去用户输入，挂载状态等等，辅助实现 game 逻辑.\r\n\r\n示例 ： .ca:\r\n```\r\n$start: \r\nA nice day.\r\n\r\nchoices:\r\n\r\na. go to 2a.\r\nb. go to A LOOP.\r\n\r\n\r\n$2a: \r\nThen?\r\nNo choice.\r\n\r\n$loop: \r\nYou can\'t excape.\r\n\r\n$end: \r\nThink you.\r\n```\r\n\r\n.js\r\n```\r\nfunction $start() {\r\n  if (ctx.cur === \"b\") {\r\n    return $loop;\r\n  }\r\n  if (ctx.cur == \"a\") {\r\n    return $2a;\r\n  }\r\n  return $start;\r\n}\r\n\r\nfunction $2a() {\r\n  return $end;\r\n}\r\n\r\nfunction $loop() {\r\n  return $start;\r\n}\r\nfunction $end() {\r\n  // dumb\r\n}\r\n```\r\n参考 demo(文件位置 /example/shelter)\r\n### repo： https://github.com/derekchuank/cmd-alive', '互动小说框架分享', '2018-11-12 02:53:33.762000', '0', '0', '110', '2018-11-12 02:53:33.762000', '2018-11-12 02:53:33.762000', '0');
INSERT INTO `demo_topic` VALUES ('5bcc139215e4fd1923f4911f', '5b52cbf1fb9e84ec69cc1ca2', 'share', 'egg-cnode开源程序搭建的网站已经上线\r\n\r\n**地址**：http://bbs.itying.com/\r\n\r\n感谢cnode的开源程序', 'cnode 的源码egg-cnode开源程序搭建的网站已经上线--感谢cnode', '2018-11-12 02:24:04.176000', '0', '0', '868', '2018-10-21 05:50:10.601000', '2018-10-21 05:50:10.601000', '0');
INSERT INTO `demo_topic` VALUES ('5be8dcf82fed25406c25d805', '597ee3db68aa87c774e5edac', 'share', '![稿定设计导出-20181108-204711.png](//static.cnodejs.org/Fo8_CVsdQq6R9DF1Wp34_HkhobF8)\r\n\r\n编者注：俗话说的好 **“并发不够，机器来凑”**，当我们面对高并发请求的时候增加机器是最简单也是最土豪的做法。不过在资源有限的情况除了去优化代码我们又该怎么办呢？今天我们请来了 @有马 同学为我们分享一下他在这方面的经验，希望能帮助到大家。\r\n\r\n———\r\n\r\n想要开发牢固的Web API只考虑安全是不够的，还有一点我们需要考虑，那就是应对大规模访问的对策。不仅是Web API服务，任何在网络上公开的服务都会时不时地遇到来自外部的大规模访问，比如“鹿晗关晓彤公布恋情”这种实时热点。当服务器遇到大规模访问时，为了处理这些访问会耗尽资源，进而无法提供服务。这时不仅是这些大规模访问，任何人都无法和服务器端建立连接。\r\n\r\n我们可以通过程序毫不费力的访问Web API，所以API服务器更容易遇到访问负载高的情况，针对这个问题，和普通的Web应用一样，我们可以对API服务进行扩容，这是正确的做法，但本文不对扩容方案展开讨论。接下来会讨论限速在应对大规模访问时一些重要的点，以及在ThinkJS开发的项目中应该怎样做。\r\n\r\n## 限制用户的访问\r\n为了解决突然出现大规模访问的问题，最现实的方法是对每个用户的访问次数进行限制。也就是确定单个用户在单位时间里最大的访问次数，如果用户已经超过了最大访问次数，用户再次访问时，服务端将会直接拒绝并返回错误信息。比如设置一个用户10分钟内只允许调用20次获取短信验证码的接口，那么当用户在10分钟内发起第21次请求时，服务器端便会返回错误信息，10分钟之后才会恢复访问。如果进行访问限速，就要先解决下面三个问题：\r\n\r\n* 如何确定限速的数值\r\n* 如何确定限速时间单位\r\n* 在什么时候重置限速的数值\r\n\r\n### 确定限速数值\r\n\r\n对数据频繁更新的查询类API而言，用户需要频繁的访问的到最新的数据，如果设置1小时只能访问10次的话，用户肯定不满意，转而去用可以替代的服务。访问限速的初衷是为了应对服务器短时间内遭遇大规模访问不堪重负从而无法提供服务，但如果让用户用起来不方便就得不偿失了，所以要尽可能的了解提供的API在什么情况下被使用，然后决定限速的数值。\r\n\r\n### 确定限速时间单位\r\n\r\n根据在线服务的不同，有些会以一天作为访问次数的时间单位，不过这对很多API来说有点长了，假设使用者正在写脚本访问API，开始并不清楚访问次数的时间单位，那就可能需要让他等24个小时才能继续访问API，或者换一个账号。如果我们以10分钟作为访问次数的时间单位，如果超出访问次数限制，也只需要等10分钟就能继续访问了。虽然单位时间的设定和API返回的数据密切相关，但大部分已公开的API都设置了都设置了1小时左右的单位时间。\r\n\r\n### 确定重置限速数值的时间\r\n\r\n当用户超出访问上限值时，服务端该如何返回响应消息呢？这种情况下可以返回HTTP协议中备好的“429 Too Many Request”状态码。429状态码在2012年4月发布的RFC 6585中定义，当特定用户在一定时间内发起的请求次数过多时，服务器端可以返回该状态码表示出错。RFC 文档中对该状态码描述如下：\r\n\r\n```\r\n429 Too Many Requests\r\n\r\n   The 429 status code indicates that the user has sent too many\r\n   requests in a given amount of time (\"rate limiting\").\r\n\r\n   The response representations SHOULD include details explaining the\r\n   condition, and MAY include a Retry-After header indicating how long\r\n```\r\n\r\n通过上面的描述可以知道，响应消息中应该包含错误的详细信息，并且可以通过`Retry-After`告知用户需要等待多长时间才能访问API。[Retry-After](https://developer.mozilla.org/en-US/docs/Web/HTTP/Headers/Retry-After)首部表示客户端需要等待多长时间才能再次访问。RFC文档中用 `MAY` 标记该首部，表示即使不发送该首部也不会有什么问题，只是在响应体加上该首部会显得更加友好。\r\n\r\n另外，`Retry-After`并不是 429 状态码专用的响应首部。该首部在HTTP 1.1的RFC 7231中定义，它也同样包含在带有503和3xx系列的响应体中。而且`Retry-After`首部用秒数来指定时间，还可以使用详细的日期信息，可以看一下RFC文档中的描述：\r\n\r\n```\r\nRetry-After\r\n\r\n   Servers send the \"Retry-After\" header field to indicate how long the\r\n   user agent ought to wait before making a follow-up request.  When\r\n   sent with a 503 (Service Unavailable) response, Retry-After indicates\r\n   how long the service is expected to be unavailable to the client.\r\n   When sent with any 3xx (Redirection) response, Retry-After indicates\r\n   the minimum time that the user agent is asked to wait before issuing\r\n   the redirected request.\r\n\r\n   The value of this field can be either an HTTP-date or a number of\r\n   seconds to delay after the response is received.\r\n\r\n     Retry-After = HTTP-date / delay-seconds\r\n\r\n   A delay-seconds value is a non-negative decimal integer, representing\r\n   time in seconds.\r\n\r\n     delay-seconds  = 1*DIGIT\r\n```\r\n \r\n## 通过HTTP响应传递限速信息\r\n\r\n在实施访问限速的过程中，如果能将当前用户访问次数限制、已使用的访问次数以及何时重置访问限速等信息告诉用户，会显得非常友好。如果不返回这些信息的话，用户可能为了确定限速是否解除而多次尝试访问接口API，这样一来无疑又增加了服务器的压力。\r\n\r\n限速信息可以放在响应消息首部，另一种是作为响应消息体数据的一部分，目前将限速信息放在响应消息首部的方式成为事实上的标准。\r\n\r\n|首部名|说明|类型|\r\n|----|----|----|\r\n|X-RateLimit-Limit|单位时间的访问上限|Integer|\r\n|X-RateLimit-Remaining|剩余的访问次数|Integer|\r\n|X-RateLimit-Reset|访问次数重置时间|UTC epoch seconds|\r\n\r\n看一下[GitHub的限速策略](https://developer.github.com/v3/#rate-limiting)，GitHub就使用了上面三个响应首部，没有带`Retry-After`首部。对于认证的请求每小时可以访问5000次，没有认证的请求每小时访问60次。\r\n\r\n而[Twitter限速策略](https://developer.twitter.com/en/docs/basics/rate-limiting.html)的时间窗口是15分钟，比GitHub的时间窗口小很多，因为Twitter的数据更新的相对较较快，时间窗口设置小一些才能满足使用者获取最新数据的需求。Twitter使用类似上面三个的响应首部传达限速信息`x-rate-limit-limit`,`x-rate-limit-remaining`,`x-rate-limit-reset`。对于GET请求有两种初始方案，一种是15分钟15次请求，另一种是15分钟180次请求，并且只允许认证访问。\r\n\r\n通过对比GitHub和Twitter的限速策略，可以知道只要准确传达限速信息，响应头部完全可以自己定义，重点是语义明确，且不能和其他标准首部冲突。\r\n\r\n## 在ThinkJS中实现API限速控制\r\n\r\n要实现API访问限速，需要对每个用户及应用访问API的次数进行计数，一般会使用`Redis`等键值对存储来记录。ThinkJS 结合自己的路由映射方式实现了[think-ratelimiter](https://github.com/thinkjs/think-ratelimiter)中间件对`action`进行限速，你需要在`middleware.js`里进行如下配置，就可以实现简单的限速策略。\r\n\r\n```javascript\r\n// in middleware.js\r\nconst redis = require(\'redis\');\r\nconst { port, host, password } = think.config(\'redis\');\r\nconst db = redis.createClient(port, host, { password });\r\nconst ratelimiter = require(\'think-ratelimiter\');\r\n\r\nmodule.exports = {\r\n  // after router middleware\r\n  {\r\n    handle: ratelimiter,\r\n    options: {\r\n      db,\r\n      errorMessage: \'Sometimes You Just Have To Slow Down\',\r\n      headers: {\r\n        remaining: \'X-RateLimit-Remaining\',\r\n        reset: \'X-RateLimit-Reset\',\r\n        total: \'X-RateLimit-Limit\'\r\n      },\r\n      resources: {\r\n        \'test/test\': { // key 是 controller/action 的拼接\r\n          id: ctx => ctx.ip,\r\n          max: 5,\r\n          duration: 7000 // ms\r\n        }\r\n      }\r\n    }\r\n  },\r\n}\r\n```\r\n\r\n响应体首部`X-RateLimit-Reset`表示可以恢复访问的时间，同时也会带着`Retry-After`首部，它的值是距离恢复时间的秒数。\r\n\r\n## 总结\r\n\r\n在ThinkJS开发的Web应用中，可以使用中间件然后添加配置实现简单的限速，如果你提供的web API服务访问量比较大或者需要付费访问等功能，就需要在真正的逻辑前加一层来做限速相关的事情，在ThinkJS中可以实现一个`services/ratelimit.js`，然后在项目的`base controller`中实现限速等逻辑。\r\n\r\n**参考资料：**\r\n\r\n* [《Web API的设计与开发》](https://book.douban.com/subject/27054104/)\r\n* [RFC 6585](https://datatracker.ietf.org/doc/rfc6585/)\r\n* [RFC 7231](https://tools.ietf.org/pdf/rfc7231.pdf)\r\n* [Retry-After](https://developer.mozilla.org/en-US/docs/Web/HTTP/Headers/Retry-After)', 'API开发中如何使用限速应对大规模访问', '2018-11-12 01:52:56.653000', '0', '0', '125', '2018-11-12 01:52:56.653000', '2018-11-12 01:52:56.653000', '0');
