INSERT INTO `demo_topic` VALUES ('5be7ce7f21d75b74609f628a', '560b3a2848055cd15e2c8957', 'share', 'NutzWk 5.1.0 Vue版本已发布，演示地址： [https://nutzwk.wizzer.cn](https://nutzwk.wizzer.cn)\r\n\r\n源码Github：[https://github.com/Wizzercn/NutzWk](https://github.com/Wizzercn/NutzWk)\r\n码云Gitee：[https://gitee.com/wizzer/NutzWk](https://gitee.com/wizzer/NutzWk)\r\n\r\n本次更新内容：\r\n* wk-nb-web-vue 新增全新的Vue后台管理界面，基于Vue.js + Element.js 等，增强交互体验；\r\n* 基础服务类 BaseService 新增一些常用的查询方法；\r\n* 微信模块增加图片自动回复、群发图片、微信菜单可配小程序等功能；\r\n* CMS模块增加前台模板标签示例代码；\r\n* 增强Oracle及MySQL兼容性；\r\n* 支持Openjdk 11；\r\n\r\n后端技术架构：java nutzboot + dubbo + zookeeper\r\n前端技术架构：vue.js + element.js + bootstrap', 'NutzWk 5.1.0 微服务开发框架，Vue版本已发布', '2018-11-11 06:38:55.029000', '0', '0', '193', '2018-11-11 06:38:55.029000', '2018-11-11 06:38:55.029000', '0');
