INSERT INTO `demo_topic` VALUES ('5bd9177ed00aac1004de5300', '5639e5516d966e1a39996b1a', 'share', '@subject: wepy-redux-time-todo   \r\n@author: leinov   \r\n@date:2018-10-30   \r\n@notice: 小程序(wepy)开发群110647537 欢迎加入\r\n# wepy-redux-time-todo\r\n![image](https://github.com/leinov/leinov.github.io/raw/master/img/timeredux.gif)\r\n## Use [github地址](https://github.com/leinov/wepy-redux-time-todo)\r\n```\r\ngit clone git@github.com:leinov/wepy-redux-time-todo.git\r\n\r\nnpm install\r\n\r\nnpm run dev\r\n```\r\n添加到微信开发者工具里即可运行\r\n## Wiki\r\n### 创建项目\r\nwepy是腾讯自出的一套小程序框架，基于Vue写法，也可以灵活使用第三方库，对原生的api也做了部分优化，提高了整体代码的可读性和可维护性，也极大的提高了开发效率，极力推荐使用。首先需要安装wepy命令，通过命令创建wepy项目，在执行下面第二句命令过程中会有一些问题，在到是否使用redux的问题时选y，在创建时就会加入redux依赖以及store文件夹\r\n```\r\nnpm install wepy-cli -g //安装全局wepy命令\r\n\r\nwepy init standard wepy-redux-time-todo // 创建wepy-redux-time-todo项目\r\n```\r\n\r\n### 项目结构\r\n执行创建命令后会出现类似以下结构的项目结构(下面是我自己创建文件后的)\r\n```\r\n |-- dist // 编译后执行文件夹\r\n |-- node_modules\r\n |-- src // 开发文件夹\r\n |   |-- components //组件\r\n        |-- sec-title.wpy\r\n     |-- pages //业务页面\r\n        |-- index.wpy\r\n     |-- store // redux\r\n        |-- actions\r\n            |-- index.js\r\n        |-- reducers\r\n            |-- timeReducer.js\r\n            |-- index.js //合并reducer\r\n        |-- types\r\n            |-- index.js\r\n     |-- style //样式\r\n        |-- weui.scss\r\n     |-- app.wpy //入口\r\n |-- package.json\r\n```\r\n\r\n### Redux概念以及使用\r\n\r\n\r\nRedux主要的作用是管理复杂的数据，多用于操作单页应用中的复杂状态，将整个应用的状态集中放在一个容器里统一管理。作为一个状态容器，他就像一个盒子(store)，这个唯一的盒子(整个应用只有一个store)里有很多状态(state), 都以一个对象树的形式储存在store 中。 **唯一能改变 state 的办法是触发 action**，action是一个简单的对象，用来描述你想要干什么。reducer是一个纯函数来根据action返回的type操作状态变化返回新状态，reducer作为createStore参数返回最新的store，下面我们通过redux官网的代码具体描述redux的执行过程，\r\n\r\n\r\n#### Action\r\n\r\naction可以理解为动作，用户希望干什么，比如点击一个按钮让页面的数字加1，切换日期，插入数组等，总之是一个希望页面状态发生改变的行为标识。action用一个对象表示,包含一个必须属性```type```\r\n```\r\n{type:\"INCREMENT\"} //表示添加动作\r\n{type:\"DECREMENT\"} //表示减法动作\r\n{type:\"GET_DATA\",payload:{}} // 表示获取数据动作并挂载一个数据在payload属性上供reducer使用，多用于异步获取数据，也可以用自己的添加其他属性\r\n```\r\n#### Reducer\r\n\r\nreducer是一个形式为 (state, action) => state 的纯函数（纯函数概念：不依赖外部环境变量，只依赖内部参数、不会产生副作用、相同的输入确保相同的输出）。描述了 action 如何把 state 转变成下一个 state。state 的形式取决于你自己，可以是基本类型、数组、对象、甚至是 Immutable.js 生成的数据结构。唯一的要点是当 state  变化时需要返回全新的对象，而不是修改传入的参数。\r\n下面例子使用 `switch` 语句和字符串来做判断，也可以用自己的方式。\r\n\r\n```\r\nfunction reducer(state = 0, action) {\r\n  switch (action.type) {\r\n  case \'INCREMENT\':\r\n    return state + 1;\r\n  case \'DECREMENT\':\r\n    return state - 1;\r\n  default:\r\n    return state;\r\n  }\r\n}\r\n```\r\n\r\n#### store\r\n\r\nredux的createStore方法用于创建应用唯一的store，createStore方法的**参数**即reducer，用于更新store内state树，通过以下创建就可以把一个初始的{state:0}的这样一个状态存入到store中\r\n```\r\nimport { createStore } from \'redux\';\r\n\r\nconst store = createStore(reducer);\r\n```\r\nstore有几个重要的方法\r\n* ```store.dispatch(action)```  //派发事件 表示要干什么\r\n* ```store.getState()``` // 获取存储在store里的所有状态(数据)\r\n* ```store.subscribe(listener)``` //手动监听状态变化\r\n\r\n#### dispatch改变状态\r\n\r\nstore.dispatch是改变状态的唯一方式，dispatch接受一个action参数（做什么），通知reducer需要做出什么样的改变，再更新整个store\r\n```\r\nstore.dispatch({INCREMENT:\"INCREMENT\"}) \r\n```\r\n这个操作会告诉reducer 当前需要给state做加1操作，\r\n#### 获取state\r\n```\r\nstore.getState() // {state:1}\r\n```\r\n\r\n### subscribe监听\r\n```\r\nstore.subscribe(() =>\r\n  console.log(store.getState())\r\n);\r\n```\r\n在dispatch触发状态更新后需要通过subscribe监听才能获得最新的状态，如果在react中使用则需要把视图渲染函数放在监听函数内。\r\n```\r\nimport store from \"./redux.js\"\r\nstore.subscribe(()=>{\r\n  ReactDOM.render(<App />, document.getElementById(\'root\'))\r\n});\r\n```\r\n> 以上是纯redux的使用，使用起来比较鸡肋，redux大量被使用在react项目中，封装库react-redux提供的Provider和connect可以将react和redux完美结合，使用非常方便。\r\n\r\n\r\n### Redux在wepy中的使用\r\n通过上面的描述应该对redux有了一定的了解，接下来我们看下redux在小程序框架wepy中如何使用，wepy中需要安装wepy-redux依赖，类似react-redux，store文件夹下放redux的操作代码，redux的使用方法都相同，这里我们讲下与react使用不一样的地方\r\n\r\n#### 初始化store\r\n首先需要在app.wpy中初始化store\r\n```\r\nimport { setStore } from \'wepy-redux\'\r\nimport configStore from \'./store\'\r\n\r\nconst store = configStore()\r\nsetStore(store)\r\n```\r\nwepy中app.wpy编译后为原生小程序中的app.js，app.js在小程序整个执行生命周期里处于最前端，在小程序初始化时来创建store，这样在所有页面都可以使用，等同于react里的Provider\r\n\r\n#### redux-actions\r\n这里使用```redux-actions```库来优化reducer里的```switch```写法。\r\n```\r\nimport { handleActions } from \"redux-actions\";\r\nimport {\r\n	TIME_CONFIG_DATA, // 学员\r\n} from \"../types/index\";\r\n\r\nexport default handleActions({\r\n	[TIME_CONFIG_DATA](state, action) {\r\n		return {\r\n			...state,\r\n			timeConfigData: action.newData\r\n		};\r\n	}\r\n}, {\r\n	timeConfigData:[], //state初始值 \r\n});\r\n```\r\n\r\n#### connect连接到wepy组件上\r\nconnect(states, actions) connect有两个参数，states是整个应用的状态，页面需要使用哪个状态对应获取该状态即可,actions业务操作，是wepy-redux对action的封装，这里我们不用这种方式，自己在action中手动dispatch，如果想要了解详细使用可参考[wepy-redux](https://www.npmjs.com/package/wepy-redux) \r\n```\r\nimport { connect } from \'wepy-redux\'\r\n @connect({\r\n    timeConfigData(state) {\r\n      return state.timeReducer.num\r\n    }\r\n  })\r\n  export default class Index extends wepy.page {\r\n  	// ...\r\n    methods = {\r\n      // ...\r\n    }\r\n    // ...\r\n    onLoad() {\r\n    }\r\n  }\r\n```\r\n使用数据\r\n```\r\n<template lang=\"wxml\">\r\n    <repeat for=\"{{timeConfigData}}\" index=\"index\" item=\"item\" key=\"key\">\r\n    </repeat>\r\n</template>\r\n```\r\n\r\n> 其他方法都与在react中使用相同，通过上面的配置就可以在wepy中使用redux了，详细代码参考[code](https://github.com/leinov/wepy-redux-time-todo)', '一个Time TodoList实例了解redux在小程序框架wepy中的使用', '2018-11-11 05:55:12.657000', '0', '0', '316', '2018-10-31 02:46:22.805000', '2018-10-31 02:46:22.805000', '0');
INSERT INTO `demo_topic` VALUES ('5b5e78f5673571454c633cea', '5b56866ae740336c7bedb345', 'share', '**koa2实战项目介绍（真全栈）：**\r\n\r\n**Nodejs+koa2实战视频教程**从零开始一步一步让你学会Koa基础以及用用**Koa开发项目**，本教程涉及 用户权限判断 、**验证码** 、分页、多级分类、**ueditor可视化富文本编辑器**、图片上传、**底层DB库封装**、**扩展art-template的核心方法、**ajax改变状态、ajax排序、以及赠送的**Socket.io机器人** 、Socket.io多人聊天室、**Socket.io群聊**、前后端分离 **RESTful API Api**接口、购买域名 服务器、域名备案、**nginx负载均衡**、**域名解析部署nodejs程序**、Nodejs进程管理器pm2模块、Koa操作**mysql数据库**\r\n\r\n**地址：** [Koa2实战视频教程下载地址点我](https://www.itying.com/goods-800.html)\r\n\r\n**2018 Nodejs+Koa2入门实战视频教程百度网盘下载地址（41讲免费基础下载地址）：**\r\n\r\nhttps://pan.baidu.com/s/1KNaA97kGwNhavch5rP_G7w', 'Nodejs+koa2实战视频教程【87讲】--Koa2+Nodejs+MongoDb打造企业级CMS前后端全栈项目实战视频教程', '2018-11-11 03:51:54.827000', '0', '0', '7777', '2018-07-30 02:33:25.113000', '2018-07-30 02:33:25.113000', '0');
INSERT INTO `demo_topic` VALUES ('5a559e54afa0a121784a8adc', '567231087223708362cc6c47', 'share', '标题虽有点夸大，不过用过nestjs之后，本人是不想在用其他框架了。这里没有想安利大家立马换框架的意思，推荐学习，若要投产，前提是你要足够了解nest。\r\n准确说，nest不是框架，而是一种区别于commonjs的模块规范，或者说是高阶构建工具，它改变了以往团队协同的编码组织结构，使得模块化开发思想真正得以实现，框架目的不是提高开发技术，而是降低模块间耦合风险，隔离了工作区间，带了前所未有的协同开发体验。具体介绍可以看我的git page  链接：[nest介绍](https://yangjdb.github.io/blog/2018/01/08/nest-1/)\r\nnestjs的学习成本较高，对于基础理论，设计模式，原生语法都要有深厚的理解能力，如果想深入了解nest，建议以下步骤：\r\n先看es6的proxy，reflect，symbol  链接：[es6的Reflect](http://es6.ruanyifeng.com/#docs/reflect)\r\n再看typescript的装饰器  链接：[TS装饰器](https://www.tslang.cn/docs/handbook/decorators.html)\r\n再看java的六大设计原则（自行百度）\r\n再看nestjs的开源代码  链接：[nestjs](https://github.com/nestjs/nest)\r\n最后写一个完整的场景覆盖demo（自己动手哦）\r\n你会发现……\r\n前端弱爆了，哈哈哈\r\n开玩笑的，你会爱上nest。', 'nestjs之后，觉得其他框架脚手架可以立碑了……', '2018-11-11 03:45:55.046000', '0', '0', '8981', '2018-01-10 05:02:12.824000', '2018-01-10 05:02:12.824000', '0');
