INSERT INTO `demo_topic` VALUES ('5be673da21d75b74609f603a', '5bda8a7793f8d64f74b012ae', 'share', '原文地址：https://www.jianshu.com/p/ab72fe404c8d\r\n\r\n# 前言\r\n前些天刚建了自己的博客：[《极简博客搭建，搭建超级简单又好看》](https://www.jianshu.com/p/527583637f17)\r\n还上了 HTTPS :[《轻松全站 HTTPS，还没用上 https (可申请泛域名证书)的朋友可以操练起来了》](https://www.jianshu.com/p/57e5bb1277ce)\r\n\r\n# 原由\r\n这些天，陆陆续续有朋友问我，这个博客能不能登录啊，有没有用户体系啊。我想也许是我小说写得好看，他们想找地方评论。准备接一个评论组件在里面，方便大家讨论我的文字以及分享自己的看法。\r\n一杯茶的功夫，我就改变了主意，准备自己搭建一个属于自己的社区。在里面汇聚一些自己喜欢的人们。这么大的变故是为什么？因为我想无论怎么接入评论组件，人仍然不在你这。第三方如果恶意收集用户的信息，并技术太弱保护不了这份数据的话，那是在害了我们的用户。且有些组件没事还没弹个广告什么的，着实有点坑。那话不多说，自己建一个吧～\r\n\r\n# 效果预览\r\n前台效果\r\n![前台效果](https://upload-images.jianshu.io/upload_images/14752545-b55d7afc02d072a9.png?imageMogr2/auto-orient/strip%7CimageView2/2/w/1240)\r\n\r\n后台效果\r\n![后台管理界面](https://upload-images.jianshu.io/upload_images/14752545-eb93a1686d7c5993.png?imageMogr2/auto-orient/strip%7CimageView2/2/w/1240)\r\n\r\n [要搭论坛，还没有服务器？ 来参加阿里云双 11 底价团，12 号前 99.5/台起！](https://m.aliyun.com/act/team1111/#/share?params=N.9g4CZ2TwSh.n2wswqow)\r\n>![优惠的一小部分](https://upload-images.jianshu.io/upload_images/14752545-847853f809e2593f.png?imageMogr2/auto-orient/strip%7CimageView2/2/w/1240)\r\n>[查看更多](https://m.aliyun.com/act/team1111/#/share?params=N.9g4CZ2TwSh.n2wswqow)\r\n\r\n# 架构一览\r\n有很多现成的社区解决方案，开源不开源的都有像 wecent、nodebb 什么的。\r\n我挑选了一个可定制化更高，我认为更好看的给大家演示一下。\r\n1. Docker\r\n2. MongoDB/pregresSQL/redis（三个选其一）\r\n3. NodeBB\r\n\r\n# 开始\r\n> ### 1.  安装 Docker (已安装的忽略)\r\n>[CentOS](https://www.jianshu.com/p/3782f86508b5)\r\n[Windows](https://download.docker.com/win/stable/Docker%20for%20Windows%20Installer.exe)\r\n[Mac](https://download.docker.com/mac/stable/Docker.dmg)\r\n\r\n>### 2. 安装 MongoDB/pregresSQL/redis三个选其一\r\n> NODE 的项目就只介绍  MongoDB 的安装吧，如需用 pregresSQL/redis 当作你的数据库，请自己安装，后面只是配置不同\r\n**先创建所需的 docker 网络**\r\n```docker network create mongo-net```\r\n创建了一个名字为`mongo-net`的默认网络\r\n**安装 mongodb**\r\n```docker run --name mongo --restart always --network mongo-net -d mongo --wiredTigerCacheSizeGB 0.25```\r\n> **参数解释(不关心的不用看)**\r\n> **docker run** 表示运行一个容器，可以想像成运行一个程序\r\n>**--name mongo** 给你的程序起个名字，mongo 可以换其它名字\r\n> **--restart always** 表示程序如果死掉就自动重新启动，保证一直提供服务\r\n>**-d** :后台运行你的这个程序\r\n>**mongo** 镜像名\r\n>**--wiredTigerCacheSizeGB 0.25** 设置最大的内存使用为 0.25G\r\n\r\n执行成功后你就完成了数据存储的部分，下面开始安装 NodeBB\r\n\r\n>3. 安装 NodeBB\r\n```docker run --restart always --name forum --network mongo-net -p 4567:4567 -d nodebb/docker```\r\n**参数解释(不关心的不用看)**\r\n**docker run** 表示运行一个容器，可以想像成运行一个程序\r\n> **--restart always** 表示程序如果死掉就自动重新启动，保证一直提供服务\r\n>**--name forum** 给你的程序起个名字，forum 可以换其它名字\r\n>**--network mongo-net** 给这个容器指定一个虚拟网络，不存在则报错，存在则加入这个网络\r\n>**-d** :后台运行你的这个程序\r\n>**nodebb/docker** 镜像名\r\n\r\n执行成功后，你的论坛就已经安装完成了。服务已经启动，你只需要简单配置就能正式上线啦～\r\n\r\n执行成功后，你的论坛就已经安装完成了。服务已经启动，你只需要简单配置就能正式上线啦～\r\n\r\n>4. 配置 NodeBB\r\n在你的浏览器中输入`http://localhost:4567` 进入配置页面\r\n![配置 NodeBB ](https://upload-images.jianshu.io/upload_images/14752545-42e8d3b10f84cf17.png?imageMogr2/auto-orient/strip%7CimageView2/2/w/1240)\r\n等一段时间后你会看到这个页面\r\n![安装完成，准备进入你的论坛](https://upload-images.jianshu.io/upload_images/14752545-208bf763b29a568a.png?imageMogr2/auto-orient/strip%7CimageView2/2/w/1240)\r\n 到这里就全部配置完成了，你可以登录后台设置你的论坛\r\n![用户登录界面](https://upload-images.jianshu.io/upload_images/14752545-c4b6680abc082950.png?imageMogr2/auto-orient/strip%7CimageView2/2/w/1240)\r\n可以修改默认语言为中文\r\n![设置语言](https://upload-images.jianshu.io/upload_images/14752545-ab78d0350faef0e7.png?imageMogr2/auto-orient/strip%7CimageView2/2/w/1240)\r\n![设置成中文，保存后刷新](https://upload-images.jianshu.io/upload_images/14752545-597376d824ab2c51.png?imageMogr2/auto-orient/strip%7CimageView2/2/w/1240)\r\n 后台界面\r\n![后台管理界面](https://upload-images.jianshu.io/upload_images/14752545-eb93a1686d7c5993.png?imageMogr2/auto-orient/strip%7CimageView2/2/w/1240)\r\n\r\n>5.后台配置\r\n到这里，你已经搭建完成了你的论坛。接下来的工作就是把你论坛配置成你想要的样子，你可以在后台安装一些你需要的插件、主题等，打造一个你自己的论坛。\r\n\r\n# 结语\r\n这个例子的所有操作都是按最简单的方式来写的，且不影响正式的使用。当然一些配置方面的优化，则要看你服务器的具体配置，具体来优化了。后台中有许多有用的插件，比如搜索都可以安装起来，来充实你的论坛。\r\n[论坛不错，可还没服务器？ 来参加阿里云双 11 底价团，12 号前 99.5/台起！](https://m.aliyun.com/act/team1111/#/share?params=N.9g4CZ2TwSh.n2wswqow)', '快速搭建论坛，用 NodeBB 搭建自己的社区，汇聚可爱的人们', '2018-11-10 10:02:48.303000', '0', '0', '187', '2018-11-10 05:59:54.592000', '2018-11-10 05:59:54.592000', '0');
INSERT INTO `demo_topic` VALUES ('5be1370121d75b74609f47b7', '5b03c9a7000332b81cf821a5', 'ask', 'let a = {\r\n	name: \'zaki\',\r\n	say: function() {\r\n		console.log(this);\r\n		console.log(this.name);\r\n	}\r\n};\r\n\r\n(function() {\r\n	a.say(); //可以打印出符合期望的的this信息\r\n	let fn = a.say;\r\n	fn(); // 不能打印出符合期望的this信息\r\n})()', 'es中的关于this指针丢失问题', '2018-11-10 08:21:40.783000', '0', '0', '455', '2018-11-06 06:38:57.821000', '2018-11-06 06:38:57.821000', '0');
INSERT INTO `demo_topic` VALUES ('5be6846821d75b74609f6065', '57d216e13d3520a5387c2b53', 'share', 'Rt', '谁有比较好的restful 的例子。', '2018-11-10 07:10:32.927000', '0', '0', '185', '2018-11-10 07:10:32.927000', '2018-11-10 07:10:32.927000', '0');
INSERT INTO `demo_topic` VALUES ('5be3a48a646a05745b7b9a47', '58d140302c8bf2a836456213', 'share', '**摘要：** 写代码是一门艺术。\r\n\r\n- 原文：[JavaScript 复杂判断的更优雅写法](https://juejin.im/post/5bdfef86e51d453bf8051bf8)\r\n- 作者：Think.\r\n- 公众号：大转转fe\r\n\r\n**[Fundebug](https://www.fundebug.com/)经授权转载，版权归原作者所有。**\r\n\r\n### 前提\r\n\r\n我们编写js代码时经常遇到复杂逻辑判断的情况，通常大家可以用if/else或者switch来实现多个条件判断，但这样会有个问题，随着逻辑复杂度的增加，代码中的if/else/switch会变得越来越臃肿，越来越看不懂，那么如何更优雅的写判断逻辑，本文带你试一下。\r\n\r\n### 举个例子\r\n\r\n先看一段代码\r\n\r\n```javascript\r\n/**\r\n * 按钮点击事件\r\n * @param {number} status 活动状态：1 开团进行中 2 开团失败 3 商品售罄 4 开团成功 5 系统取消\r\n */\r\nconst onButtonClick = (status)=>{\r\n  if(status == 1){\r\n    sendLog(\'processing\')\r\n    jumpTo(\'IndexPage\')\r\n  }else if(status == 2){\r\n    sendLog(\'fail\')\r\n    jumpTo(\'FailPage\')\r\n  }else if(status == 3){\r\n    sendLog(\'fail\')\r\n    jumpTo(\'FailPage\')\r\n  }else if(status == 4){\r\n    sendLog(\'success\')\r\n    jumpTo(\'SuccessPage\')\r\n  }else if(status == 5){\r\n    sendLog(\'cancel\')\r\n    jumpTo(\'CancelPage\')\r\n  }else {\r\n    sendLog(\'other\')\r\n    jumpTo(\'Index\')\r\n  }\r\n}\r\n```\r\n\r\n通过代码可以看到这个按钮的点击逻辑：根据不同活动状态做两件事情，发送日志埋点和跳转到对应页面，大家可以很轻易的提出这段代码的改写方案，switch出场：\r\n\r\n```javascript\r\n/**\r\n * 按钮点击事件\r\n * @param {number} status 活动状态：1 开团进行中 2 开团失败 3 商品售罄 4 开团成功 5 系统取消\r\n */\r\nconst onButtonClick = (status)=>{\r\n  switch (status){\r\n    case 1:\r\n      sendLog(\'processing\')\r\n      jumpTo(\'IndexPage\')\r\n      break\r\n    case 2:\r\n    case 3:\r\n      sendLog(\'fail\')\r\n      jumpTo(\'FailPage\')\r\n      break  \r\n    case 4:\r\n      sendLog(\'success\')\r\n      jumpTo(\'SuccessPage\')\r\n      break\r\n    case 5:\r\n      sendLog(\'cancel\')\r\n      jumpTo(\'CancelPage\')\r\n      break\r\n    default:\r\n      sendLog(\'other\')\r\n      jumpTo(\'Index\')\r\n      break\r\n  }\r\n}\r\n```\r\n\r\n嗯，这样看起来比if/else清晰多了，细心的同学也发现了小技巧，case 2和case 3逻辑一样的时候，可以省去执行语句和break，则case 2的情况自动执行case 3的逻辑。\r\n\r\n这时有同学会说，还有更简单的写法：\r\n\r\n```javascript\r\nconst actions = {\r\n  \'1\': [\'processing\',\'IndexPage\'],\r\n  \'2\': [\'fail\',\'FailPage\'],\r\n  \'3\': [\'fail\',\'FailPage\'],\r\n  \'4\': [\'success\',\'SuccessPage\'],\r\n  \'5\': [\'cancel\',\'CancelPage\'],\r\n  \'default\': [\'other\',\'Index\'],\r\n}\r\n/**\r\n * 按钮点击事件\r\n * @param {number} status 活动状态：1开团进行中 2开团失败 3 商品售罄 4 开团成功 5 系统取消\r\n */\r\nconst onButtonClick = (status)=>{\r\n  let action = actions[status] || actions[\'default\'],\r\n      logName = action[0],\r\n      pageName = action[1]\r\n  sendLog(logName)\r\n  jumpTo(pageName)\r\n}\r\n```\r\n\r\n上面代码确实看起来更清爽了，这种方法的聪明之处在于：将判断条件作为对象的属性名，将处理逻辑作为对象的属性值，在按钮点击的时候，通过对象属性查找的方式来进行逻辑判断，这种写法特别适合一元条件判断的情况。\r\n\r\n是不是还有其他写法呢？有的：\r\n\r\n```javascript\r\nconst actions = new Map([\r\n  [1, [\'processing\',\'IndexPage\']],\r\n  [2, [\'fail\',\'FailPage\']],\r\n  [3, [\'fail\',\'FailPage\']],\r\n  [4, [\'success\',\'SuccessPage\']],\r\n  [5, [\'cancel\',\'CancelPage\']],\r\n  [\'default\', [\'other\',\'Index\']]\r\n])\r\n/**\r\n * 按钮点击事件\r\n * @param {number} status 活动状态：1 开团进行中 2 开团失败 3 商品售罄 4 开团成功 5 系统取消\r\n */\r\nconst onButtonClick = (status)=>{\r\n  let action = actions.get(status) || actions.get(\'default\')\r\n  sendLog(action[0])\r\n  jumpTo(action[1])\r\n}\r\n```\r\n\r\n这样写用到了es6里的Map对象，是不是更爽了？Map对象和Object对象有什么区别呢？\r\n\r\n1. 一个对象通常都有自己的原型，所以一个对象总有一个\"prototype\"键。\r\n2. 一个对象的键只能是字符串或者Symbols，但一个Map的键可以是任意值。\r\n3. 你可以通过size属性很容易地得到一个Map的键值对个数，而对象的键值对个数只能手动确认。\r\n\r\n我们需要把问题升级一下，以前按钮点击时候只需要判断status，现在还需要判断用户的身份：\r\n\r\n```javascript\r\n/**\r\n * 按钮点击事件\r\n * @param {number} status 活动状态：1开团进行中 2开团失败 3 开团成功 4 商品售罄 5 有库存未开团\r\n * @param {string} identity 身份标识：guest客态 master主态\r\n */\r\nconst onButtonClick = (status,identity)=>{\r\n  if(identity == \'guest\'){\r\n    if(status == 1){\r\n      //do sth\r\n    }else if(status == 2){\r\n      //do sth\r\n    }else if(status == 3){\r\n      //do sth\r\n    }else if(status == 4){\r\n      //do sth\r\n    }else if(status == 5){\r\n      //do sth\r\n    }else {\r\n      //do sth\r\n    }\r\n  }else if(identity == \'master\') {\r\n    if(status == 1){\r\n      //do sth\r\n    }else if(status == 2){\r\n      //do sth\r\n    }else if(status == 3){\r\n      //do sth\r\n    }else if(status == 4){\r\n      //do sth\r\n    }else if(status == 5){\r\n      //do sth\r\n    }else {\r\n      //do sth\r\n    }\r\n  }\r\n}\r\n```\r\n\r\n原谅我不写每个判断里的具体逻辑了，因为代码太冗长了。\r\n\r\n原谅我又用了if/else，因为我看到很多人依然在用if/else写这种大段的逻辑判断。\r\n\r\n从上面的例子我们可以看到，当你的逻辑升级为二元判断时，你的判断量会加倍，你的代码量也会加倍，这时怎么写更清爽呢？\r\n\r\n```javascript\r\nconst actions = new Map([\r\n  [\'guest_1\', ()=>{/*do sth*/}],\r\n  [\'guest_2\', ()=>{/*do sth*/}],\r\n  [\'guest_3\', ()=>{/*do sth*/}],\r\n  [\'guest_4\', ()=>{/*do sth*/}],\r\n  [\'guest_5\', ()=>{/*do sth*/}],\r\n  [\'master_1\', ()=>{/*do sth*/}],\r\n  [\'master_2\', ()=>{/*do sth*/}],\r\n  [\'master_3\', ()=>{/*do sth*/}],\r\n  [\'master_4\', ()=>{/*do sth*/}],\r\n  [\'master_5\', ()=>{/*do sth*/}],\r\n  [\'default\', ()=>{/*do sth*/}],\r\n])\r\n\r\n/**javascript\r\n * 按钮点击事件\r\n * @param {string} identity 身份标识：guest客态 master主态\r\n * @param {number} status 活动状态：1 开团进行中 2 开团失败 3 开团成功 4 商品售罄 5 有库存未开团\r\n */\r\nconst onButtonClick = (identity,status)=>{\r\n  let action = actions.get(`${'${'}identity}_${'${'}status}`) || actions.get(\'default\')\r\n  action.call(this)\r\n}\r\n```\r\n\r\n上述代码核心逻辑是：把两个条件拼接成字符串，并通过以条件拼接字符串作为键，以处理函数作为值的Map对象进行查找并执行，这种写法在多元条件判断时候尤其好用。\r\n\r\n当然上述代码如果用Object对象来实现也是类似的：\r\n\r\n```javascript\r\nconst actions = {\r\n  \'guest_1\':()=>{/*do sth*/},\r\n  \'guest_2\':()=>{/*do sth*/},\r\n  //....\r\n}\r\n\r\nconst onButtonClick = (identity,status)=>{\r\n  let action = actions[`${'${'}identity}_${'${'}status}`] || actions[\'default\']\r\n  action.call(this)\r\n}\r\n```\r\n\r\n如果有些同学觉得把查询条件拼成字符串有点别扭，那还有一种方案，就是用Map对象，以Object对象作为key：\r\n\r\n```javascript\r\nconst actions = new Map([\r\n  [{identity:\'guest\',status:1},()=>{/*do sth*/}],\r\n  [{identity:\'guest\',status:2},()=>{/*do sth*/}],\r\n  //...\r\n])\r\n\r\nconst onButtonClick = (identity,status)=>{\r\n  let action = [...actions].filter(([key,value])=>(key.identity == identity && key.status == status))\r\n  action.forEach(([key,value])=>value.call(this))\r\n}\r\n```\r\n\r\n是不是又高级了一点点？\r\n\r\n这里也看出来Map与Object的区别，Map可以用任何类型的数据作为key。\r\n\r\n我们现在再将难度升级一点点，假如guest情况下，status1-4的处理逻辑都一样怎么办，最差的情况是这样：\r\n\r\n```javascript\r\nconst actions = new Map([\r\n  [{identity:\'guest\',status:1},()=>{/* functionA */}],\r\n  [{identity:\'guest\',status:2},()=>{/* functionA */}],\r\n  [{identity:\'guest\',status:3},()=>{/* functionA */}],\r\n  [{identity:\'guest\',status:4},()=>{/* functionA */}],\r\n  [{identity:\'guest\',status:5},()=>{/* functionB */}],\r\n  //...\r\n])\r\n```\r\n\r\n好一点的写法是将处理逻辑函数进行缓存：\r\n\r\n```javascript\r\nconst actions = ()=>{\r\n  const functionA = ()=>{/*do sth*/}\r\n  const functionB = ()=>{/*do sth*/}\r\n  return new Map([\r\n    [{identity:\'guest\',status:1},functionA],\r\n    [{identity:\'guest\',status:2},functionA],\r\n    [{identity:\'guest\',status:3},functionA],\r\n    [{identity:\'guest\',status:4},functionA],\r\n    [{identity:\'guest\',status:5},functionB],\r\n    //...\r\n  ])\r\n}\r\n\r\nconst onButtonClick = (identity,status)=>{\r\n  let action = [...actions()].filter(([key,value])=>(key.identity == identity && key.status == status))\r\n  action.forEach(([key,value])=>value.call(this))\r\n}\r\n```\r\n\r\n这样写已经能满足日常需求了，但认真一点讲，上面重写了4次functionA还是有点不爽，假如判断条件变得特别复杂，比如identity有3种状态，status有10种状态，那你需要定义30条处理逻辑，而往往这些逻辑里面很多都是相同的，这似乎也是笔者不想接受的，那可以这样实现:\r\n\r\n```javascript\r\nconst actions = ()=>{\r\n  const functionA = ()=>{/*do sth*/}\r\n  const functionB = ()=>{/*do sth*/}\r\n  return new Map([\r\n    [/^guest_[1-4]$/,functionA],\r\n    [/^guest_5$/,functionB],\r\n    //...\r\n  ])\r\n}\r\n\r\nconst onButtonClick = (identity,status)=>{\r\n  let action = [...actions()].filter(([key,value])=>(key.test(`${'${'}identity}_${'${'}status}`)))\r\n  action.forEach(([key,value])=>value.call(this))\r\n}\r\n```\r\n\r\n这里Map的优势更加凸显，可以用正则类型作为key了，这样就有了无限可能，假如需求变成，凡是guest情况都要发送一个日志埋点，不同status情况也需要单独的逻辑处理，那我们可以这样写:\r\n\r\n```javascript\r\nconst actions = ()=>{\r\n  const functionA = ()=>{/*do sth*/}\r\n  const functionB = ()=>{/*do sth*/}\r\n  const functionC = ()=>{/*send log*/}\r\n  return new Map([\r\n    [/^guest_[1-4]$/,functionA],\r\n    [/^guest_5$/,functionB],\r\n    [/^guest_.*$/,functionC],\r\n    //...\r\n  ])\r\n}\r\n\r\nconst onButtonClick = (identity,status)=>{\r\n  let action = [...actions()].filter(([key,value])=>(key.test(`${'${'}identity}_${'${'}status}`)))\r\n  action.forEach(([key,value])=>value.call(this))\r\n}\r\n```\r\n\r\n也就是说利用数组循环的特性，符合正则条件的逻辑都会被执行，那就可以同时执行公共逻辑和单独逻辑，因为正则的存在，你可以打开想象力解锁更多的玩法，本文就不赘述了。\r\n\r\n### 总结\r\n\r\n本文已经教你了8种逻辑判断写法，包括：\r\n\r\n1. if/else\r\n2. switch\r\n3. 一元判断时：存到Object里\r\n4. 一元判断时：存到Map里\r\n5. 多元判断时：将condition拼接成字符串存到Object里\r\n6. 多元判断时：将condition拼接成字符串存到Map里\r\n7. 多元判断时：将condition存为Object存到Map里\r\n8. 多元判断时：将condition写作正则存到Map里\r\n\r\n至此，本文也将告一段落，愿你未来的人生里，不只是有if/else/switch。\r\n\r\n### 关于Fundebug\r\n\r\n[Fundebug](https://www.fundebug.com/)专注于JavaScript、微信小程序、微信小游戏、支付宝小程序、React Native、Node.js和Java实时BUG监控。 自从2016年双十一正式上线，Fundebug累计处理了7亿+错误事件，得到了Google、360、金山软件、百姓网等众多知名用户的认可。欢迎免费试用！\r\n\r\n![](https://static.fundebug.cn/wechat_slogan.png)', 'JavaScript复杂判断的更优雅写法', '2018-11-10 04:11:10.476000', '0', '0', '555', '2018-11-08 02:50:50.115000', '2018-11-08 02:50:50.115000', '0');
INSERT INTO `demo_topic` VALUES ('5b972808ce9d14c2254df8b0', '56ea011fa70420bd420d0001', 'share', '楼主自己也是才踩 react 的路。。之前偷懒用了 vuejs 就不思上进了...无赖美帝都是 react 占据了90个点的江山.*\r\n**一直觉得学习，选择好的学习资料和学习的顺序很重要.. 对了，路子顺..挫折感小. ** 希望自己的学习顺序，能给别人带来帮助.\r\n群主弄了个 QQ 技术交流群: 371932256 ，方便讨论我的 cnodejs 的 react 版本的项目...一起进步...也欢迎高手加入...哈哈...\r\n\r\n1. 掌握 react 的基本概念\r\n   1.1 看视频课程：https://time.geekbang.org/course/intro/100 （非推广…只是个人是个很热心的妹砸） 01 ~10\r\n  1.2 边看然后边刷官方的 Main Concepts 部分的文档https://reactjs.org/docs/hello-world.html 做好第一步和第二步后，对 react 有基本的概念了…\r\n \r\n 2. 学习 redux/react-redux\r\n  2.1 看ruanyifeng 的 redux/react-redux 教程… 看教程第一二篇的时候，会有个基本的概念呢…\r\n  2.2  然后返回去看 11~ 15， 视频讲解的 redux、react 课程\r\n当然你在刷课课程中，也会不时的去看看官方文档看看些细节. flux 等概念\r\n 2.3  在上述步骤（3.1 ~3.2 ） 中，你会做 Counter 的例子，了解 redux 的基本玩法… 也会把 Counter的例子改成结合 react-redux 类型的; \r\n如果这两个例子完成了…可以试试这个视频教程…\r\n2.4 完成一个小demo: https://www.youtube.com/watch?v=93p3LxR9xfM&t=1168s 这部分想必，对新手会绕一段时间…特别是 redux 这部分如果你没进去看过源码…有时候会被 API 绕晕…觉得 API 多\r\n这边是楼主写的 redux 阅读笔记: https://github.com/pandoracat/learn-react/blob/master/Notes/Redux/includes/markdown/ReduxSourceCode.md\r\n\r\n3. 完成学习 react基本概念.. redux/react-redux 基本用法后...（一定要试着敲每个课程的代码哟，扎扎实实走过来的，你内心才踏实)\r\n可以直接去 react-router 官网看看 demo, 边用用demo, 了解文档，了解用法. 如果有朋友觉得英文文档看起来吃力，可以看看这个 https://www.jianshu.com/p/1781bc1dd938#24-history\r\n4. 学习完这些后，咱看看 react 项目，代码咋拆分..咋组织\r\n课程22~25 ： https://time.geekbang.org/course/detail/100-11278 \r\n\r\n5. 这些都过了,下面看 react 怎么测试。关于 react 测试： 强行硬广一波自己的笔记：https://github.com/pandoracat/frontend-testing ，我记录了自己的 javascript 测试的学习路程...\r\n6. 上面这些你都做了...咱们再把视频教程撸撸... 再次提升下自己的理解..\r\n7. 最后，react cnode , 新手练手都用它 ?..看看 它的 api, 咱们 ready go 写个项目试试.\r\n这边是我正在写的 https://github.com/pandoracat/react-cnode 欢迎瞧瞧..我会写自己的 readme, 方便你照着模仿一个...\r\n弱弱的觉得自己设计的风格还不错（偷笑,我是一个审美超级弱的前端妹纸）\r\n怎么开始这个用 cnodejs.org 做 api 服务器的练手项目呢?请点击：https://github.com/pandoracat/react-cnode\r\n\r\n群主弄了个 QQ 技术交流群: 371932256 ，方便讨论我的 cnodejs 的 react 版本的项目...一起进步...也欢迎高手加入...哈哈...', '分享自己的 react 学习路径', '2018-11-09 15:50:31.974000', '0', '0', '1693', '2018-09-11 02:27:20.076000', '2018-09-11 02:27:20.076000', '0');
INSERT INTO `demo_topic` VALUES ('5231a630101e574521e45ef8', '5110f2bedf9e9fcc584e4677', 'share', 'require 用来加载代码，而 exports 和 module.exports 则用来导出代码。但很多新手可能会迷惑于 exports 和 module.exports 的区别，为了更好的理解 exports 和 module.exports 的关系，我们先来巩固下 js 的基础。示例：\r\n\r\n**test.js**\r\n\r\nvar a = {name: 1};\r\nvar b = a;\r\n\r\nconsole.log(a);\r\nconsole.log(b);\r\n\r\nb.name = 2;\r\nconsole.log(a);\r\nconsole.log(b);\r\n\r\nvar b = {name: 3};\r\nconsole.log(a);\r\nconsole.log(b);\r\n\r\n运行 test.js 结果为：\r\n\r\n{ name: 1 }\r\n{ name: 1 }\r\n{ name: 2 }\r\n{ name: 2 }\r\n{ name: 2 }\r\n{ name: 3 }\r\n\r\n**解释**：a 是一个对象，b 是对 a 的引用，即 a 和 b 指向同一块内存，所以前两个输出一样。当对 b 作修改时，即 a 和 b 指向同一块内存地址的内容发生了改变，所以 a 也会体现出来，所以第三四个输出一样。当 b 被覆盖时，b 指向了一块新的内存，a 还是指向原来的内存，所以最后两个输出不一样。\r\n\r\n明白了上述例子后，我们只需知道三点就知道 exports 和 module.exports 的区别了：\r\n\r\n1. module.exports 初始值为一个空对象 {}\r\n2. exports 是指向的 module.exports 的引用\r\n3. require() 返回的是 module.exports 而不是 exports\r\n\r\n现在我们来看 Node.js 官方文档的截图:\r\n![屏幕快照 2016-09-29 上午11.59.44.png](//static.cnodejs.org/FjN9jHWiy-yuUtghTUlRgB_0cgUC)\r\n我们经常看到这样的写法：\r\n```\r\nexports = module.exports = somethings\r\n```\r\n上面的代码等价于:\r\n```\r\nmodule.exports = somethings\r\nexports = module.exports\r\n```\r\n原理很简单，即 module.exports 指向新的对象时，exports 断开了与 module.exports 的引用，那么通过 exports = module.exports 让 exports 重新指向 module.exports 即可。', 'exports 和 module.exports 的区别', '2018-11-09 11:15:38.918000', '1', '0', '263868', '2013-09-12 11:32:00.741000', '2013-09-12 11:32:00.741000', '0');
INSERT INTO `demo_topic` VALUES ('5be50091646a05745b7ba10a', '5be13241646a05745b7b8d26', 'ask', '最近在看node in aciton 照着书来当用到标准库模组就会无响应，使用npm install 把标准库模组安装到目录下也是一样。\r\n不使用标准库的模组的文件就可以正常执行，搜了一圈并没有看到类似问题，菜鸟初提问欢迎批评', 'node 执行文件后无响应', '2018-11-09 10:46:04.900000', '0', '0', '181', '2018-11-09 03:35:45.610000', '2018-11-09 03:35:45.610000', '0');
INSERT INTO `demo_topic` VALUES ('5be4f94121d75b74609f5ad8', '5683f44959ec59521f2f1761', 'ask', '![捕获.JPG](//static.cnodejs.org/FsqsvOu5mz4uHo_Af3paIAAytQHX)\r\n\r\n---\r\n\r\n而且在postman中第一次请求耗时是500ms左右？\r\n![捕获2.JPG](//static.cnodejs.org/Fq30Z-sNQP_h4_JnC2EKC9mx643U)\r\n\r\n\r\n---\r\n\r\n是因为TCP链接建立的时间么？后面有keepAlive所以时间减少了？', '测试koa的并发能力，为什么都是从1000ms开始缓慢降下来的？', '2018-11-09 10:37:49.343000', '0', '0', '300', '2018-11-09 03:04:33.451000', '2018-11-09 03:04:33.451000', '0');
INSERT INTO `demo_topic` VALUES ('5a049ced88c853c52fd56804', '57d216e13d3520a5387c2b53', 'ask', '我刚才试了试，就连最新版本的qq浏览器 9.6.5极速版都不支持，更别提兼容模式了，还有ie好多版本更不支持，你们在工作中，会实际用es7 es8的写法吗\n\n来自酷炫的 [CNodeMD](https://github.com/TakWolf/CNode-Material-Design)', '大家工作中真的会用asnyc await这种es7的写法吗', '2018-11-09 10:00:07.692000', '0', '0', '2054', '2017-11-09 18:22:37.015000', '2017-11-09 18:22:37.015000', '0');
INSERT INTO `demo_topic` VALUES ('5bdd1af6646a05745b7b7bf3', '59aa89ea9e95202d08c91ed3', 'ask', '```\r\n(async () => {\r\n	const mobileUrl = `http://mobile.open.163.com/movie/MCL8DCPJT/getMoviesForAndroid.htm`;\r\n	const resp = await fetch(mobileUrl, {\'mode\': \'no-cors\'});\r\n	const data = await resp.json();\r\n	console.log(data);\r\n})();\r\n```\r\n我将下载的内容手动用JSON.parse解析却OK', '为什么fetch后~报JSON解析错误？', '2018-11-09 09:24:32.501000', '0', '0', '457', '2018-11-03 03:50:14.968000', '2018-11-03 03:50:14.968000', '0');
