INSERT INTO `demo_topic` VALUES ('51fc8bd944e76d216ab64939', '50ab99f8637ffa41554d1fa9', 'share', '转载自：[http://blog.csdn.net/kidx_/article/details/9709387](http://blog.csdn.net/kidx_/article/details/9709387)\r\n\r\nGM : GraphicsMagick for node.js\r\n首先得安装 GraphicsMagick 或者 ImageMagick。\r\n然后执行：\r\n     $ sudo npm install gm\r\n\r\n我安装的是ImageMagick，在ubuntu系统下快速安装：\r\n     $ sudo apt-get install imagemagick\r\n\r\nHOW TO USE\r\nGM 文档：[http://aheckmann.github.io/gm/docs.html](http://aheckmann.github.io/gm/docs.html)\r\n使用ImageMagick\r\n    var imageMagick = gm.subClass({ imageMagick: true });\r\n然后就像文档中使用gm那样使用ImageMagick即可（举个例子）\r\n    imageMagick(\"img.png\").resize(300, 100).autoOrient().write(\'/path\', callback);\r\n\r\nExample (nodejs + Express)\r\n\r\n    var gm = require(\'gm\')\r\n    ,  fs = require(\'fs\')\r\n    ,	imageMagick = gm.subClass({ imageMagick : true });\r\n    exports.imgUpload = function(req, res) {\r\n    	res.header(\'Content-Type\', \'text/plain\');\r\n      var path = req.files.img.path;	//获取用户上传过来的文件的当前路径\r\n      var sz = req.files.img.size;\r\n      if (sz > 2*1024*1024) {\r\n        fs.unlink(path, function() {	//fs.unlink 删除用户上传的文件\r\n          res.end(\'1\');\r\n        });\r\n      } else if (req.files.img.type.split(\'/\')[0] != \'image\') {\r\n        fs.unlink(path, function() {\r\n          res.end(\'2\');\r\n        });\r\n      } else {\r\n        imageMagick(path)\r\n        .resize(150, 150, \'!\') //加(\'!\')强行把图片缩放成对应尺寸150*150！\r\n        .autoOrient()\r\n        .write(\'public/images/user/\'+req.files.img.name, function(err){\r\n          if (err) {\r\n            console.log(err);\r\n            res.end();\r\n          }\r\n          fs.unlink(path, function() {\r\n            return res.end(\'3\');\r\n          });\r\n        });\r\n      }\r\n    };\r\n\r\n上面只是index.js文件的部分核心代码\r\n[点击去下载完整Example](http://pan.baidu.com/share/link?shareid=2913111267&uk=2552401515)\r\n\r\n示例运行截图：\r\n![alt example](http://img.blog.csdn.net/20130802161424593?watermark/2/text/aHR0cDovL2Jsb2cuY3Nkbi5uZXQva2lkeF8=/font/5a6L5L2T/fontsize/400/fill/I0JBQkFCMA==/dissolve/70/gravity/Center)\r\n\r\n可以查看 public/images/user/ 里面的图片，验证你上传的图片是否被缩放了。\r\n\r\n同理可对图片进行裁切：\r\ngm(\"img.png\").crop(width, height, x, y)\r\n\r\n详情看gm的文档http://aheckmann.github.io/gm/docs.html\r\n\r\n', 'Node.js 对图片进行裁切、缩放 (gm)', '2018-11-09 06:33:11.846000', '1', '0', '69436', '2013-08-03 04:49:29.434000', '2013-08-03 04:49:29.434000', '0');
INSERT INTO `demo_topic` VALUES ('5be41bfa21d75b74609f57dd', '580c1addc3fead57507172a9', 'ask', '正在写一个koa项目 需要使用redis存储数据 遇到的问题是redis存储是异步的 不能保证执行顺序 有人遇到类似问题嘛？是怎么解决的呢。。。', 'koa项目中使用redis如何控制执行顺序', '2018-11-09 04:10:40.864000', '0', '0', '228', '2018-11-08 11:20:26.643000', '2018-11-08 11:20:26.643000', '0');
INSERT INTO `demo_topic` VALUES ('516e0ab46d382773067a5473', '50cbf5fb637ffa41556d22f2', null, ' 我要将用户查询的结果信息保存到csv或者execl（由于没有找到合适的execl库，所以采用csv库保存）中， 结果用execl打开csv文件发现乱码，通过google找到iconv-lite，可结果还是不行 。代码如下：\r\nfs.open(config.UP_PATH+\'/csv/\'+troopId+year+month+\'.csv\',\'a\');\r\n    var csvData = \'\"序号\",\"检查人\",\"检查日期\",\"省\",\"城市\",\"系统\",\"售点\",\"地址\",\"门店类型\",\'+shopnames;\r\n    var b = Iconv.encode(csvData,\'GBK\');\r\n    csv().from.string(b).to(config.UP_PATH+\"/csv/\"+troopId+year+month+\'.csv\');\r\n\r\n\r\nshopnames：是一个中文字符串变量', '怎么解决数据保存到csv文件乱码问题', '2018-11-09 03:56:42.719000', '0', '0', '46771', '2013-04-17 02:36:36.681000', '2013-04-17 02:36:36.681000', '0');
INSERT INTO `demo_topic` VALUES ('5be4f36c21d75b74609f5a73', '5639e5516d966e1a39996b1a', 'share', '![webpack-react-multi-page](http://www.h5cool.com/webpack-react3.png)\r\n \r\n\r\n## 仓库\r\nhttps://github.com/leinov/webpack-react-multi-page\r\n\r\n## 特性\r\n* ?‍?‍?‍? 支持多页面同时热加载开发\r\n* ? 自动识别新创建页面\r\n* ? 每个页面生成个性化信息\r\n* ? 分类打包\r\n* ? 灵活扩展\r\n\r\n\r\n## 安装&使用\r\n\r\n```\r\n// clone\r\ngit clone git@github.com:leinov/webpack-react-multi-page.git\r\n\r\n// 安装依赖包\r\nnpm install\r\n\r\n// 开发\r\nnpm run dev\r\n\r\n// 编译打包\r\nnpm run build\r\n\r\n// 启动生产页面\r\nnpm start\r\n```\r\n新创建页面在src下添加文件夹并创建```pageinfo.json``` 然后```npm run dev``` 即可\r\n```\r\n|-- src\r\n    |-- index/\r\n    |-- page2/\r\n        |-- index.js\r\n        |-- pageinfo.json\r\n```\r\n## 项目架构\r\n#### 技术使用\r\n* ```react16```\r\n* ```webpack4```\r\n    * ```html-webpack-plugin 生成html文件```\r\n    * ```mini-css-extract-plugin css分离打包```\r\n    * ```uglifyjs-webpack-plugin js压缩```\r\n    * ```optimize-css-assets-webpack-plugin css压缩```\r\n* ```es6```\r\n* ```babel```\r\n* ```node ```\r\n    * ```opn 打开浏览器```\r\n    * ```compression 开启gzip压缩```\r\n    * ```express```\r\n    * ```fs```\r\n* ```git```\r\n\r\n#### 目录结构\r\n```\r\n|-- webpack-react-multi-pages //项目\r\n    |-- dist //编译生产目录\r\n        |-- index\r\n            |-- index.css\r\n            |-- index.js\r\n        |-- about\r\n            |-- about.css\r\n            |-- about.js\r\n        |-- images\r\n        |-- index.html\r\n        |-- about.html\r\n    |-- node_modules //node包\r\n    |-- src //开发目录\r\n        |-- index //index页面打包入口\r\n            |-- images/\r\n            |-- js\r\n                |-- app.js// 业务js\r\n            |-- index.sass\r\n            |-- index.js //页面js入口\r\n        |-- about //about页面打包入口\r\n            |-- images/\r\n                |--js\r\n                    |-- app.js// 业务js\r\n            |-- about.sass\r\n            |-- about.js //页面js入口\r\n        |-- template.html // html模板\r\n        |-- style.sass //公共sass\r\n    |-- webpackConfig //在webpack中使用\r\n        |-- getEntry.js //获取入口\r\n        |-- getFilepath.js //src下需要打包页面文件夹\r\n        |-- htmlconfig.js //每个页面html注入数据\r\n    |-- package.json\r\n    |-- .gitignore\r\n    |-- webpack.config.js //webpack配置文件\r\n    |-- www.js //生产启动程序\r\n```\r\n\r\n## [完整wiki](http://www.leinov.com/webpack-react-multi-page/)', 'node+webpack+react多页面开发终极架构', '2018-11-09 02:39:40.798000', '0', '0', '215', '2018-11-09 02:39:40.798000', '2018-11-09 02:39:40.798000', '0');
INSERT INTO `demo_topic` VALUES ('5be23052646a05745b7b90c0', '545870576537f4d52c414eb6', 'ask', '如题，我的网站采用 七牛云 存储 实现图片托管，近期七牛云更改业务规范，要求必须 使用备案域名 更新 存储配置 ，否则停止为新上传的图片提供cdn服务\r\n大家如何应对？ 申请备案好特么麻烦', '七牛云 要求必须配置备案后的域名 才能继续使用，大家如何应对？ 本论坛也是七牛云吧', '2018-11-09 02:22:16.701000', '0', '0', '371', '2018-11-07 00:22:42.869000', '2018-11-07 00:22:42.869000', '0');
