INSERT INTO `demo_topic_reply` VALUES ('5ba6338c9545eaf107b9c564', '5ba5fd6237a6965f59051bd1', '2018111306343304716358894956', '<div class=\"markdown-text\"><p><a href=\"/user/waitingsong\">@waitingsong</a>\n说句实话，直接在框架层使用这个worker方案，我并不认为是好事。\n比如这会让beforeStart行为很奇怪，会让调试的现象更诡异以及架构灵活性会被相对较大的制约。\n并不是说框架的worker的技术不好，讲真，主进程fork出agent管理cluster的方案是可以的。但感觉不适合直接打在框架里，我可能更愿意把worker做成更可插拔的功能。</p>\n<p>当然egg会有上面的worker方案也必然经过了深思熟虑的，而我可能也只看到了一面</p>\n</div>', '5ba601d115e4fd1923f489b8', '2018-09-22 12:20:28.154000', '2018-09-22 12:20:28.154000', '0');
