INSERT INTO `demo_topic_reply` VALUES ('5ba8eaf99545eaf107b9c5ac', '5ba5fd6237a6965f59051bd1', '2018111306343287815318329816', '<div class=\"markdown-text\"><p><a href=\"/user/zy445566\">@zy445566</a>  如果框架不实现worker 那么 worker 的通信恐怕不好管理。 目前的方案应该是兼顾各方面平衡的结果。</p>\n</div>', '5ba6338c9545eaf107b9c564', '2018-09-24 13:47:37.954000', '2018-09-24 13:47:37.954000', '0');
