INSERT INTO `demo_topic_reply` VALUES ('5ba9b4fe37a6965f59051c51', '5ba5fd6237a6965f59051bd1', '2018111306343318717120531892', '<div class=\"markdown-text\"><p>一直在用EGG，茶叶蛋很好吃</p>\n</div>', null, '2018-09-25 04:09:34.609000', '2018-09-25 04:09:34.609000', '0');
INSERT INTO `demo_topic_reply` VALUES ('5ba9f6889545eaf107b9c5e2', '5ba5fd6237a6965f59051bd1', '2018111306343304716358894956', '<div class=\"markdown-text\"><p><a href=\"/user/waitingsong\">@waitingsong</a> 不对，我的意思是根本不要worker。\n我为什么要在框架里面充分利用CPU，我更愿意开4个容器每个设置1核来用，用容器来伸缩。\n而且直接在框架中增加，我觉得增加复杂度远大于我性能提升的好处。\n你这个回答显然没有说服我，我都不要worker了，为什么还要worker通讯</p>\n</div>', '5ba8eaf99545eaf107b9c5ac', '2018-09-25 08:49:12.496000', '2018-09-25 08:49:12.496000', '0');
INSERT INTO `demo_topic_reply` VALUES ('5baa1e7c15e4fd1923f48a47', '5ba5fd6237a6965f59051bd1', '2018111306343287815318329816', '<div class=\"markdown-text\"><p><a href=\"/user/zy445566\">@zy445566</a> 这你得问问lz了\n我认为多容器，也存在对容器（服务）的管理，包括状态监控、任务分发等。这依然需要一个上层的抽象层来实现。而egg不过是集成了而已，并且实现也许比容器方案还简单些。</p>\n</div>', '5ba9f6889545eaf107b9c5e2', '2018-09-25 11:39:40.681000', '2018-09-25 11:39:40.681000', '0');
INSERT INTO `demo_topic_reply` VALUES ('5baa232715e4fd1923f48a4c', '5ba5fd6237a6965f59051bd1', '2018111306343304716358894956', '<div class=\"markdown-text\"><p><a href=\"/user/waitingsong\">@waitingsong</a>\n好吧，感谢你的回答，谢谢</p>\n</div>', '5baa1e7c15e4fd1923f48a47', '2018-09-25 11:59:35.054000', '2018-09-25 11:59:35.054000', '0');
INSERT INTO `demo_topic_reply` VALUES ('5baa2bc115e4fd1923f48a4f', '5ba5fd6237a6965f59051bd1', '2018111306343287815318329816', '<div class=\"markdown-text\"><p><a href=\"/user/zy445566\">@zy445566</a> egg是小而全的框架，追求简洁，所以多任务是自己实现而没采用现成的 pm2。大而全的就是 k8s 那陀拉～\n你也可以设定egg只启动一个 worker （加上master和agent总共3个进程） 然后容器化嘛。</p>\n</div>', '5baa232715e4fd1923f48a4c', '2018-09-25 12:36:17.991000', '2018-09-25 12:36:17.991000', '0');
INSERT INTO `demo_topic_reply` VALUES ('5baa2dd28f5b0c1c59ea1166', '5ba5fd6237a6965f59051bd1', '4f447c2f0a8abae26e01b27d', '<div class=\"markdown-text\"><p>没有银弹，实在不需要，如上说的，一个 worker，一个 agent，一个 master 就好了，没啥资源损耗。</p>\n<p>实在要定制，可以自己写个 my-egg-cluster，然后基于 egg-core 继承为自己的一个框架。但缺点就是，生态里面用到 agent 和消息机制的一些插件会挂掉。或者是类似 egg-mock 那样，把 app 和 agent 放到一个进程里面去加载，这样是可以兼容插件。</p>\n<p><strong>但问题是，我们的资源利用率需要扣这么一点么？</strong> 一定要把所有目前暂时不需要的，即使不碍事的，也全部要清理掉么？</p>\n<p>我们自己业务一般是配置 docker 为 4 个 cpu，启动 4 个 worker。</p>\n<p>还有一种场景，不一定准确：</p>\n<blockquote>\n<p>同样是 16 个实例的情况下，如果 agent 里面跟后端建立长连接，如果是 4 worker + 4 docker 就只有 4 条长连接，而 1 worker + 16 docker 是 16 条。</p>\n</blockquote>\n<p>在 Egg 出现的时候，甚至到现在，Docker 也并没有成为每个团队的可选项。</p>\n<p>没有银弹，只关乎历史惯性 + 取舍的平衡点。</p>\n</div>', null, '2018-09-25 12:45:06.816000', '2018-09-25 12:45:06.816000', '0');
INSERT INTO `demo_topic_reply` VALUES ('5baad5ab9545eaf107b9c5f9', '5ba5fd6237a6965f59051bd1', '2018111306343327117677663549', '<div class=\"markdown-text\"><p>持续关注 666</p>\n</div>', null, '2018-09-26 00:41:15.775000', '2018-09-26 00:41:15.775000', '0');
