INSERT INTO `demo_topic_reply` VALUES ('5be2a7d7646a05745b7b95fe', '5be29f7c21d75b74609f4fbf', '2018111306343304716358894956', '<div class=\"markdown-text\"><p>图文并茂，文章写的不错\n运营商劫持估计换https也不太行，有些恶心的，直接用iframe包住你的网页，它该显示照样显示，那群人为了赚钱野路子贼多。</p>\n</div>', null, '2018-11-07 08:52:39.415000', '2018-11-07 08:52:39.415000', '0');
INSERT INTO `demo_topic_reply` VALUES ('5be2b2c4646a05745b7b967c', '5be29f7c21d75b74609f4fbf', '5bda8a7793f8d64f74b012ae', '<div class=\"markdown-text\"><p><a href=\"/user/zy445566\">@zy445566</a> 运营商劫持 https 可以解决的。</p>\n<p>运营商并不能在 https 的原文里添加任何信息，加了客户端就解不开了。</p>\n</div>', '5be2a7d7646a05745b7b95fe', '2018-11-07 09:39:16.291000', '2018-11-07 09:39:16.291000', '0');
INSERT INTO `demo_topic_reply` VALUES ('5be2bd3121d75b74609f516d', '5be29f7c21d75b74609f4fbf', '2018111306344623291731237834', '<div class=\"markdown-text\"><p>对于访问量日IP没超过1万的网站来说，用caddy就够了，支持<strong>免费自动申请通配符https证书</strong>，配置非常简单。</p>\n<pre class=\"prettyprint\"><code>sudo yum update\nsudo yum install epel-release\nsudo yum install caddy\nsudo systemctl enable --now caddy.service\n\nvi &#x2F;etc&#x2F;caddy&#x2F;Caddyfile\n</code></pre><p>粘贴以下代码到<code>/etc/caddy/Caddyfile</code>中</p>\n<pre class=\"prettyprint\"><code>focalhot.com, www.focalhot.com {\n    redir 301 {\n      if {host} starts_with focalhot.com\n         &#x2F; https:&#x2F;&#x2F;www.focalhot.com{uri}\n    }\n    proxy &#x2F; 127.0.0.1:8080 {\n      transparent\n    }\n    gzip\n    tls focalhot@foxmail.com\n}\n</code></pre><p>重启caddy服务</p>\n<pre class=\"prettyprint\"><code>sudo systemctl restart caddy\n</code></pre></div>', null, '2018-11-07 10:23:45.090000', '2018-11-07 10:23:45.090000', '0');
INSERT INTO `demo_topic_reply` VALUES ('5be2c6fc21d75b74609f51ae', '5be29f7c21d75b74609f4fbf', '5bda8a7793f8d64f74b012ae', '<div class=\"markdown-text\"><p><a href=\"/user/944609\">@944609</a> 赞，是好思路！</p>\n</div>', '5be2bd3121d75b74609f516d', '2018-11-07 11:05:32.181000', '2018-11-07 11:05:32.181000', '0');
INSERT INTO `demo_topic_reply` VALUES ('5be2d17021d75b74609f520c', '5be29f7c21d75b74609f4fbf', '2018111306343100604643722442', '<div class=\"markdown-text\"><p><a href=\"/user/944609\">@944609</a> 一直用caddy，今天才知道，epel源里居然有</p>\n</div>', '5be2bd3121d75b74609f516d', '2018-11-07 11:50:08.177000', '2018-11-07 11:50:08.177000', '0');
INSERT INTO `demo_topic_reply` VALUES ('5be38f4721d75b74609f535f', '5be29f7c21d75b74609f4fbf', '5bda8a7793f8d64f74b012ae', '<div class=\"markdown-text\"><p><a href=\"/user/zuohuadong\">@zuohuadong</a> 不错啊，大家都用起了 caddy，我还以为用的人不太多呢。开心</p>\n</div>', '5be2d17021d75b74609f520c', '2018-11-08 01:20:07.135000', '2018-11-08 01:20:07.135000', '0');
INSERT INTO `demo_topic_reply` VALUES ('5be3a78521d75b74609f545f', '5be29f7c21d75b74609f4fbf', '2018111306345004713516392374', '<div class=\"markdown-text\"><p><a href=\"/user/gladmo\">@gladmo</a> 楼上的意思,应该是你的域名并不是解析到你的ip,而是解析到运营商的ip,运营商返回他自己的html,然后把你的ip地址放在自己页面的iframe中,这样应该是不需要修改你的https的请求的.</p>\n</div>', '5be2b2c4646a05745b7b967c', '2018-11-08 03:03:33.534000', '2018-11-08 03:03:33.534000', '0');
INSERT INTO `demo_topic_reply` VALUES ('5be3b0d3646a05745b7b9af3', '5be29f7c21d75b74609f4fbf', '2018111306343100604643722442', '<div class=\"markdown-text\"><p><a href=\"/user/JsonSong89\">@JsonSong89</a>  但问题是此时你虽然可以提供正确的内容，但无法提供 正确的https证书。</p>\n<p>并且 原站 https 响应里 可以设置禁止 iframe</p>\n</div>', '5be3a78521d75b74609f545f', '2018-11-08 03:43:15.957000', '2018-11-08 03:43:15.957000', '0');
INSERT INTO `demo_topic_reply` VALUES ('5be3b0fe646a05745b7b9afd', '5be29f7c21d75b74609f4fbf', '2018111306343100604643722442', '<div class=\"markdown-text\"><p><a href=\"/user/gladmo\">@gladmo</a>  之前caddy 中文文档翻译了一半～</p>\n</div>', '5be38f4721d75b74609f535f', '2018-11-08 03:43:58.462000', '2018-11-08 03:43:58.462000', '0');
INSERT INTO `demo_topic_reply` VALUES ('5be44a2521d75b74609f588e', '5be29f7c21d75b74609f4fbf', '5bda8a7793f8d64f74b012ae', '<div class=\"markdown-text\"><p><a href=\"/user/JsonSong89\">@JsonSong89</a> 还能有这么骚的操作吗，666</p>\n</div>', '5be3a78521d75b74609f545f', '2018-11-08 14:37:25.704000', '2018-11-08 14:37:25.704000', '0');
INSERT INTO `demo_topic_reply` VALUES ('5be44a5f21d75b74609f5892', '5be29f7c21d75b74609f4fbf', '5bda8a7793f8d64f74b012ae', '<div class=\"markdown-text\"><p><a href=\"/user/zuohuadong\">@zuohuadong</a> 感谢对开源软件作出这么大的贡献，如果可以，可以在评论里宣传一下。我挺喜欢 caddy的</p>\n</div>', '5be3b0fe646a05745b7b9afd', '2018-11-08 14:38:23.638000', '2018-11-08 14:38:23.638000', '0');
