INSERT INTO `demo_topic_reply` VALUES ('5be5a519646a05745b7ba576', '5be29f7c21d75b74609f4fbf', '2018111306343304716358894956', '<div class=\"markdown-text\"><p><a href=\"/user/JsonSong89\">@JsonSong89</a> <a href=\"/user/zuohuadong\">@zuohuadong</a>\n有个https劫持案例，正好也是跟iframe相关\n<a href=\"https://www.zhihu.com/question/35720092/answer/523563873\">https://www.zhihu.com/question/35720092/answer/523563873</a></p>\n</div>', null, '2018-11-09 15:17:45.649000', '2018-11-09 15:17:45.649000', '0');
INSERT INTO `demo_topic_reply` VALUES ('5be5b63221d75b74609f5f6b', '5be29f7c21d75b74609f4fbf', '2018111306343100604643722442', '<div class=\"markdown-text\"><p><a href=\"/user/zy445566\">@zy445566</a></p>\n<pre class=\"prettyprint\"><code>X-Frame-Options: DENY（禁止被Iframe嵌套）\nX-Frame-Options: SAMEORIGIN（只允许同域名中被Iframe嵌套，二级域名不一致也不可以）\nX-Frame-Options: ALLOW-FROM https:&#x2F;&#x2F;example.com&#x2F;（可能存在浏览器兼容问题）\n</code></pre><p>另外针对网吧这种直接在客户端电脑植入证书的，你可以通过 CAA 解析来解决。</p>\n</div>', '5be5a519646a05745b7ba576', '2018-11-09 16:30:42.971000', '2018-11-09 16:30:42.971000', '0');
