INSERT INTO `demo_topic_reply` VALUES ('5b3f12ec13ca2fe569fb914b', '5b3e2e8c35342ab069061298', '587599e6e65101c634fc9644', '<div class=\"markdown-text\"><p><a href=\"/user/dbit-xia\">@dbit-xia</a> 比如有三个子系统，那么 SSO 服务器注销就需要跳转分别跳转三个子系统去注销，这样理解对吗？</p>\n</div>', '5b3e912bfb9e84ec69cc186a', '2018-07-06 06:57:48.093000', '2018-07-06 06:57:48.093000', '0');
INSERT INTO `demo_topic_reply` VALUES ('5b42ca5bfb9e84ec69cc18ed', '5b3e2e8c35342ab069061298', '2018111306345390635691505200', '<div class=\"markdown-text\"><p><a href=\"/user/zhongxia245\">@zhongxia245</a> 这个 直接在sso服务器注销就可以\n其他站点在判断下有没有那个sso 的 cookie</p>\n</div>', '5b3f12ec13ca2fe569fb914b', '2018-07-09 02:37:15.722000', '2018-07-09 02:37:15.722000', '0');
INSERT INTO `demo_topic_reply` VALUES ('5b6174ecb71aedfe4c126659', '5b3e2e8c35342ab069061298', '587599e6e65101c634fc9644', '<div class=\"markdown-text\"><p><a href=\"/user/puzzle9\">@puzzle9</a> sso 不在一个域名下， 拿不到 sso 的 cookie 的\n后面解决了，子系统把 登录的 session 存在 数据库或者 redis 里面， 然后 sso 注销后，通知子系统去注销相对应的 session</p>\n</div>', '5b42ca5bfb9e84ec69cc18ed', '2018-08-01 08:53:00.975000', '2018-08-01 08:53:00.975000', '0');
INSERT INTO `demo_topic_reply` VALUES ('5b629fd6792f59ae501bf6f4', '5b3e2e8c35342ab069061298', '2018111306345394035895562024', '<div class=\"markdown-text\"><p>我们实现的sso系统做单点退出原理就是在用户中心退出时分别通知各个子系统\n子系统负责自身的退出逻辑即可</p>\n</div>', null, '2018-08-02 06:08:22.368000', '2018-08-02 06:08:22.368000', '0');
INSERT INTO `demo_topic_reply` VALUES ('5be3aa6421d75b74609f54d5', '5b3e2e8c35342ab069061298', '587599e6e65101c634fc9644', '<div class=\"markdown-text\"><p><a href=\"/user/hackboy\">@hackboy</a> 对的哈</p>\n</div>', '5b629fd6792f59ae501bf6f4', '2018-11-08 03:15:48.648000', '2018-11-08 03:15:48.648000', '0');
INSERT INTO `demo_topic_reply` VALUES ('5be53d6f646a05745b7ba364', '5b3e2e8c35342ab069061298', '2018111306345394935992131687', '<div class=\"markdown-text\"><p><a href=\"https://oauth.net/2/\">https://oauth.net/2/</a> 解决你的问题,</p>\n</div>', null, '2018-11-09 07:55:27.130000', '2018-11-09 07:55:27.130000', '0');
INSERT INTO `demo_topic_reply` VALUES ('5be8f8a5e161dc409d760af4', '5b3e2e8c35342ab069061298', '5a94076871327bb413bbfe96', '<div class=\"markdown-text\"><p>主系统提供用cookie换用户信息和验证的接口。\n子站每次刷新去请求主站接口。根据接口的返回，子站维护一个属于自己的session。</p>\n</div>', null, '2018-11-12 03:51:01.643000', '2018-11-12 03:51:01.643000', '0');
