INSERT INTO `demo_topic_reply` VALUES ('5be8e4442fed25406c25d861', '5bcc139215e4fd1923f4911f', '5b52cbf1fb9e84ec69cc1ca2', '<div class=\"markdown-text\"><p><a href=\"/user/zlyuanteng\">@zlyuanteng</a>  服务器配置稍微高一些</p>\n</div>', '5be2d873646a05745b7b97c6', '2018-11-12 02:24:04.173000', '2018-11-12 02:24:04.173000', '0');
INSERT INTO `demo_topic_reply` VALUES ('5be6dff8646a05745b7ba7b4', '5be6cffb646a05745b7ba792', '580c1addc3fead57507172a9', '<div class=\"markdown-text\"><p>刚才调试了一下 不是tofixed问题 问题在于乘100之后 原来的数字精度就消失了 成了一长串数字</p>\n</div>', null, '2018-11-10 13:41:12.811000', '2018-11-10 13:41:12.811000', '0');
INSERT INTO `demo_topic_reply` VALUES ('5be70a8f646a05745b7ba7ec', '5be6cffb646a05745b7ba792', '2018111306350131178081725015', '<div class=\"markdown-text\"><p>如果你不最后乘100，那么 toFixed() 就没问题。所以根本就不是 toFixed() 的问题。</p>\n</div>', null, '2018-11-10 16:42:55.515000', '2018-11-10 16:42:55.515000', '0');
INSERT INTO `demo_topic_reply` VALUES ('5be787a921d75b74609f619c', '5be6cffb646a05745b7ba792', '2018111306350131578078942928', '<div class=\"markdown-text\"><p>就不能先乘再toFixed？</p>\n</div>', null, '2018-11-11 01:36:41.458000', '2018-11-11 01:36:41.458000', '0');
INSERT INTO `demo_topic_reply` VALUES ('5be79002646a05745b7ba82f', '5be6cffb646a05745b7ba792', '2018111306350131978049539597', '<div class=\"markdown-text\"><p>这和期望0.1+0.2===0.3是一样的问题。不是toFixed的问题，而是计算过程中精度丢失了。toFixed放在最后一步吧。</p>\n</div>', null, '2018-11-11 02:12:18.544000', '2018-11-11 02:12:18.544000', '0');
INSERT INTO `demo_topic_reply` VALUES ('5be8cecd2fed25406c25d6ef', '5be6cffb646a05745b7ba792', '2018111306343108905124170703', '<div class=\"markdown-text\"><p><code>toFixed</code>返回的是字符串的值。我一般这样玩：</p>\n<pre class=\"prettyprint language-js\"><code>Math.round(分子&#x2F;分母 * 10000) &#x2F; 100.00\n</code></pre><p>四舍五入保留2位小数百分率。</p>\n</div>', null, '2018-11-12 00:52:29.362000', '2018-11-12 00:52:29.362000', '0');
INSERT INTO `demo_topic_reply` VALUES ('5be8dac1e161dc409d7609ec', '5be6cffb646a05745b7ba792', '2018111306350132678110869205', '<div class=\"markdown-text\"><p>0.1 + 0.2 !== 0.3</p>\n</div>', null, '2018-11-12 01:43:29.868000', '2018-11-12 01:43:29.868000', '0');
INSERT INTO `demo_topic_reply` VALUES ('5be6efb221d75b74609f614f', '5be69602646a05745b7ba710', '2018111306343100604643722442', '<div class=\"markdown-text\"><p><a href=\"https://expressjs.com/en/api.html#app.listen\">https://expressjs.com/en/api.html#app.listen</a><br>\n去看文档</p>\n</div>', null, '2018-11-10 14:48:18.968000', '2018-11-10 14:48:18.968000', '0');
INSERT INTO `demo_topic_reply` VALUES ('5be8d9f62fed25406c25d7db', '5be69602646a05745b7ba710', '2018111306350268085805727239', '<div class=\"markdown-text\"><pre class=\"prettyprint language-js\"><code>const fs = require(&#x27;fs&#x27;)\nconst express = require(&#x27;express&#x27;)\n\nconst privatekey = fs.readFileSync(&#x27;.&#x2F;ca&#x2F;private.key&#x27;, &#x27;utf8&#x27;)\nconst certificate = fs.readFileSync(&#x27;.&#x2F;ca&#x2F;full_chain.pem&#x27;, &#x27;utf8&#x27;)\n\nconst app = express()\n\nconst http = require(&#x27;http&#x27;).Server(app)\nconst https = require(&#x27;https&#x27;).Server({\n    key: privatekey,\n    cert: certificate\n}, app)\n</code></pre></div>', null, '2018-11-12 01:40:06.573000', '2018-11-12 01:40:06.573000', '0');
