INSERT INTO `demo_topic_reply` VALUES ('5be7a5f3646a05745b7ba87f', '5a559e54afa0a121784a8adc', '2018111306343100604643722442', '<div class=\"markdown-text\"><p><a href=\"/user/shen100\">@shen100</a> 话说能一起搞么，我们最近打算做个微服务版的CMS，  用户服务＋CMS服务＋CMS API (带SSR)前台 前端 可以是 vue 或者 angular，后台前端用angular 在做一套企业级后台。</p>\n<p>到时候 用户服务＋BBS 服务 ＋ BBS API ，后台可以用我们写的。\n用 cli 一键启动，减少部署成本。</p>\n</div>', '5bdfa86821d75b74609f3ce2', '2018-11-11 03:45:55.042000', '2018-11-11 03:45:55.042000', '0');
INSERT INTO `demo_topic_reply` VALUES ('5bc4c9c415e4fd1923f48f4d', '5bc4c826ede204052db80566', '57b3bfd4d6124db37b1d1333', '<div class=\"markdown-text\"><p>默认启动的是 <a href=\"http://127.0.0.1:7001\">http://127.0.0.1:7001</a>，如何变成是https://127.0.0.1:7001</p>\n</div>', null, '2018-10-15 17:09:24.780000', '2018-10-15 17:09:24.780000', '0');
