INSERT INTO `demo_topic_reply` VALUES ('5be69514646a05745b7ba700', '5be1370121d75b74609f47b7', '59817d2328607f916122dbb9', '<div class=\"markdown-text\"><p>class里的方法的this指向的是实例，你可以在构造函数里绑定一下this的指向\nclass = {\n	constructor (){\n		this.say = this.say,bind(this);\n	}\n}</p>\n</div>', null, '2018-11-10 08:21:40.779000', '2018-11-10 08:21:40.779000', '0');
