INSERT INTO `demo_topic_reply` VALUES ('5231e30b101e574521edd6d2', '5231a630101e574521e45ef8', '2018111306352350304989033329', '<div class=\"markdown-text\"><p>“也就是说 exports 和 module.exports 不再指向同一块内存，也就是说此时 exports 和 module.exports 毫无联系，也就是说 module.exports 指向的那块内存并没有做任何改变，仍然为一个空对象 {} ，也就是说 area.js 导出了一个空对象，所以我们在 app.js 中调用 area(4) 会报 TypeError: object is not a function 的错误。”</p>\n<p>这段话好多 也就是说。。。。</p>\n</div>', null, '2013-09-12 15:51:39.891000', '2013-09-12 15:51:39.891000', '0');
INSERT INTO `demo_topic_reply` VALUES ('52329e13101e574521ff28f7', '5231a630101e574521e45ef8', '2018111306352350804983692038', '<div class=\"markdown-text\"><p>写的非常赞. 要是有图做个说明就最好了.</p>\n<p>一开始我没有理解,原因是我没有明白nodejs 是怎么创建module.exports 和 exports,并且二者关系是怎么样的.</p>\n<p>系统自动给nodejs 文件增加2个变量 exports 和 module, module 又有一个属性 exports, 这个exports 属性指向一个空对象 {}; 同时 exports这个变量也指向了这个空对象{};</p>\n<p>于是就有了 exports =&gt; {} &lt;=module.exports.</p>\n<p>这2个exports 其实是没有直接关系的,唯一的关系是: 他们初始都指向同一个空对象{};\n如果其中一个不指向做个空对象了, 那么他们的关系就没有了.</p>\n</div>', null, '2013-09-13 05:09:39.974000', '2013-09-13 05:09:39.974000', '0');
INSERT INTO `demo_topic_reply` VALUES ('52348927101e574521357e9b', '5231a630101e574521e45ef8', '2018111306352368705941262287', '<div class=\"markdown-text\"><p>懂的人看楼主的解释觉得很多余，不懂的人估计看得会比较迷糊，一个简单的例子：\n~function(exports, module){\nconsole.log(exports)\n//这里只要进行其它初始化的操作都会导致同样的效果\nexports = {}\nconsole.log(exports)\nconsole.log(module.document)\n}(window.document, window)</p>\n</div>', null, '2013-09-14 16:04:55.262000', '2013-09-14 16:04:55.262000', '0');
