INSERT INTO `demo_topic_reply` VALUES ('52efcdd3953654bb719fd605', '5231a630101e574521e45ef8', '2018111306352392407308760712', '<div class=\"markdown-text\"><p>前辈你好，\n请问你的N-blog在heroku部署时 <a href=\"http://cuitianze.herokuapp.com/\">http://cuitianze.herokuapp.com/</a> 为什么会出现如下的问题呢</p>\n<p>Application Error</p>\n<p>An error occurred in the application and your page could not be served. Please try again in a few moments.</p>\n<p>If you are the application owner, check your logs for details.</p>\n<p>另外，应该不是部署的问题，因为你的另一个开源作品N-chat能够部署成功 <a href=\"http://tianze.herokuapp.com/\">http://tianze.herokuapp.com/</a></p>\n</div>', null, '2014-02-03 17:11:47.576000', '2014-02-03 17:11:47.576000', '0');
INSERT INTO `demo_topic_reply` VALUES ('535283361969a7b22aac3d75', '5231a630101e574521e45ef8', '2018111306352393107331350922', '<div class=\"markdown-text\"><p>“module.exports = somethings 是对 module.exports 进行了覆盖，此时 module.exports 和 exports 的关系断裂，module.exports 指向了新的内存块，而 exports 还是指向原来的内存块”\n前面不是说 exports 是指向 module.exports 的引用吗？为什么对 module.exports 赋新值会打断 module.exports 和 exports 的关系？</p>\n</div>', null, '2014-04-19 14:07:50.188000', '2014-04-19 14:07:50.188000', '0');
