INSERT INTO `demo_topic_reply` VALUES ('569fab06cd415452622eec99', '5231a630101e574521e45ef8', '2018111306352500113548435075', '<div class=\"markdown-text\"><p>这本书讲的非常好，\n<a href=\"http://eloquentjavascript.net/10_modules.html\">eloquentjavascript</a>\n上面讲了一个比较naive的实现\nfunction require(name) {\nif (name in require.cache) {\nreturn require.cache[name];\n}\nvar code = new Function(“exports, module”, readFile(name));\nvar exports = {}, module = {exports: exports};\ncode(exports, module);</p>\n<pre class=\"prettyprint\"><code>  require.cache[name] = module.exports;\n  return module.exports;\n}\nrequire.cache = Object.create(null);</code></pre></div>', null, '2016-01-20 15:43:02.270000', '2016-01-20 15:43:02.270000', '0');
