INSERT INTO `demo_topic_reply` VALUES ('56de32588023c6146ec3fdc6', '5231a630101e574521e45ef8', '2018111306352530315244895804', '<div class=\"markdown-text\"><p><a href=\"/user/LiZhenNet\">@LiZhenNet</a></p>\n<blockquote>\n<p>Node模块允许你从被引入文件中选择要暴露给程序的函数和变量。如果模块返回的函数或变量不止一个，那它可以通过设定exports对象的属性来指明它们。但如果模块只返回一个函数或变量，则可以设定module.exports属性。–《Node.js 实战》</p>\n</blockquote>\n</div>', '56d564457fc3af3a77db46da', '2016-03-08 02:00:56.163000', '2016-03-08 02:00:56.163000', '0');
