INSERT INTO `demo_topic_reply` VALUES ('58880979250bf4e2390e9f3e', '5231a630101e574521e45ef8', '2018111306352639221423396580', '<div class=\"markdown-text\"><p>可以自己跑一下，马上就有一个清晰的了解。\n<code>module.exports.name=&quot;123&quot;;</code>\n<code>console.info(arguments);</code>\n<code>console.info(&quot;-----------------------------&quot;)</code>\n<code>console.info(exports);</code>\n<code>console.info(&quot;-----------------------------&quot;)</code>\n<code>console.info(module);</code></p>\n<p><code>{ \'0\': { name: \'123\' },</code>\n<code>\'1\':</code>\n<code>{ [Function: require]</code>\n<code>resolve: [Function: resolve],</code>\n<code>main:</code>\n<code>Module {</code>\n<code>id: \'.\',</code>\n<code>exports: [Object],</code>\n<code>parent: null,</code>\n<code>filename: \'F:\\\\WORK\\\\Nodejs\\\\OneKey\\\\routes\\\\test.js\',</code>\n<code>loaded: false,</code>\n<code>children: [],</code>\n<code>paths: [Object] },</code>\n<code>extensions: { \'.js\': [Function], \'.json\': [Function], \'.node\': [Function] },</code>\n<code>cache: { \'F:\\WORK\\Nodejs\\OneKey\\routes\\test.js\': [Object] } },</code>\n<code>\'2\':</code>\n<code>Module {</code>\n<code>id: \'.\',</code>\n<code>exports: { name: \'123\' },</code>\n<code>parent: null,</code>\n<code>filename: \'F:\\\\WORK\\\\Nodejs\\\\OneKey\\\\routes\\\\test.js\',</code>\n<code>loaded: false,</code>\n<code>children: [],</code>\n<code>paths:</code>\n<code>[ \'F:\\\\WORK\\\\Nodejs\\\\OneKey\\\\routes\\\\node_modules\', \'F:\\\\WORK\\\\Nodejs\\\\OneKey\\\\node_modules\', \'F:\\\\WORK\\\\Nodejs\\\\node_modules\', \'F:\\\\WORK\\\\node_modules\', \'F:\\\\node_modules\' ] },</code>\n<code>\'3\': \'F:\\\\WORK\\\\Nodejs\\\\OneKey\\\\routes\\\\test.js\',</code>\n<code>\'4\': \'F:\\\\WORK\\\\Nodejs\\\\OneKey\\\\routes\' }</code>\n<code>-----------------------------</code>\n<code>{ name: \'123\' }</code>\n<code>-----------------------------</code>\n<code>Module {</code>\n<code>id: \'.\',</code>\n<code>exports: { name: \'123\' },</code>\n<code>parent: null,</code>\n<code>filename: \'F:\\\\WORK\\\\Nodejs\\\\OneKey\\\\routes\\\\test.js\',</code>\n<code>loaded: false,</code>\n<code>children: [],</code>\n<code>paths:</code>\n<code>[ \'F:\\\\WORK\\\\Nodejs\\\\OneKey\\\\routes\\\\node_modules\', \'F:\\\\WORK\\\\Nodejs\\\\OneKey\\\\node_modules\', \'F:\\\\WORK\\\\Nodejs\\\\node_modules\', \'F:\\\\WORK\\\\node_modules\', \'F:\\\\node_modules\' ] }</code></p>\n</div>', null, '2017-01-25 02:12:09.504000', '2017-01-25 02:12:09.504000', '0');
