INSERT INTO `demo_topic_reply` VALUES ('58a7aeb27872ea0864fede68', '5231a630101e574521e45ef8', '2018111306352642721681643851', '<div class=\"markdown-text\"><p>不错不错，好文章 <a href=\"https://wuxiaozhou.coding.me/cnode-react/\">——来自吴小粥的cnode-react手机版</a></p>\n</div>', null, '2017-02-18 02:17:22.643000', '2017-02-18 02:17:22.643000', '0');
INSERT INTO `demo_topic_reply` VALUES ('58caba019aa9bafe76762a4b', '5231a630101e574521e45ef8', '2018111306352643221673484542', '<div class=\"markdown-text\"><p>看到英文解释中有一句说的，当你搞不明白export和module.export的关系的时候，就一直使用module.export好了。看了好几篇文章，大概知道export是module.export的引用，然后export是个局部变量，module是个全局变量。</p>\n</div>', null, '2017-03-16 16:14:57.608000', '2017-03-16 16:14:57.608000', '0');
INSERT INTO `demo_topic_reply` VALUES ('5a936d0f8d6e16e56bb808e6', '5231a630101e574521e45ef8', '2018111306352661522722491159', '<div class=\"markdown-text\"><p>“原理很简单，即 module.exports 指向新的对象时，exports 断开了与 module.exports 的引用，那么通过 exports = module.exports 让 exports 重新指向 module.exports 即可。”  这一段有点画蛇添足。引用官网的一句 “如果一个新的值被赋值给 exports，它就不再绑定到 module.exports”</p>\n</div>', null, '2018-02-26 02:12:31.979000', '2018-02-26 02:12:31.979000', '0');
INSERT INTO `demo_topic_reply` VALUES ('5ad7744fa7d228c16b986f01', '5231a630101e574521e45ef8', '2018111306352662122792002171', '<div class=\"markdown-text\"><p>mark</p>\n</div>', null, '2018-04-18 16:37:35.528000', '2018-04-18 16:37:35.528000', '0');
INSERT INTO `demo_topic_reply` VALUES ('5b1f5d0929e6e510415b2a13', '5231a630101e574521e45ef8', '2018111306352662522892537382', '<div class=\"markdown-text\"><p><a href=\"/user/azathothes\">@azathothes</a> 简写吧，比如</p>\n<pre class=\"prettyprint\"><code>exports.a = 1; &#x2F;&#x2F;确实没有什么乱用，统一用一种方式就ok了，多了反而容易引起混淆\n</code></pre></div>', '58998a8a5dfbcdfa083b401d', '2018-06-12 05:41:29.398000', '2018-06-12 05:41:29.398000', '0');
INSERT INTO `demo_topic_reply` VALUES ('5be51b4221d75b74609f5bc0', '5231a630101e574521e45ef8', '2018111306352662922886680398', '<div class=\"markdown-text\"><p>浅显易懂，</p>\n</div>', null, '2018-11-09 05:29:38.969000', '2018-11-09 05:29:38.969000', '0');
INSERT INTO `demo_topic_reply` VALUES ('5be56c5a21d75b74609f5e8e', '5231a630101e574521e45ef8', '5be13241646a05745b7b8d26', '<div class=\"markdown-text\"><p>最后一句 “原理很简单，即 module.exports 指向新的对象时，exports 断开了与 module.exports 的引用，那么通过 exports = module.exports 让 exports 重新指向 module.exports 即可。”\n应该是 “原理很简单，即 exports 指向新的对象时，exports 断开了与 module.exports 的引用，那么通过 exports = module.exports 让 exports 重新指向 module.exports 即可” 对吧。</p>\n</div>', null, '2018-11-09 11:15:38.913000', '2018-11-09 11:15:38.913000', '0');
