INSERT INTO `demo_topic_reply` VALUES ('5a05760aee9b35da75a86a2a', '5a049ced88c853c52fd56804', '2018111306353054645244853447', '<div class=\"markdown-text\"><p>Javascript要被淘汰了，现在开发，要么Bablescript，要么Typescript (:手动)</p>\n</div>', null, '2017-11-10 09:48:58.690000', '2017-11-10 09:48:58.690000', '0');
