INSERT INTO `demo_topic_reply` VALUES ('5be55aa721d75b74609f5e4e', '5a049ced88c853c52fd56804', '5b03c9a7000332b81cf821a5', '<div class=\"markdown-text\"><p>以前都用co，后来用babel把co代码都改为async/await了</p>\n</div>', null, '2018-11-09 10:00:07.687000', '2018-11-09 10:00:07.687000', '0');
INSERT INTO `demo_topic_reply` VALUES ('5bdd5444646a05745b7b7cbb', '5bdd1af6646a05745b7b7bf3', '59aa89ea9e95202d08c91ed3', '<div class=\"markdown-text\"><p>没人理我，自个顶帖</p>\n<p>在浏览器扩展中，不使用no-cors模式fetch就不出错！真让人恼火</p>\n</div>', null, '2018-11-03 07:54:44.168000', '2018-11-03 07:54:44.168000', '0');
INSERT INTO `demo_topic_reply` VALUES ('5be5462b646a05745b7ba3ce', '5bdd1af6646a05745b7b7bf3', '59aa89ea9e95202d08c91ed3', '<div class=\"markdown-text\"><p>使用no-cors模式不能读取body~即内容！！真是鸡肋的功能！！！！</p>\n</div>', null, '2018-11-09 08:32:43.908000', '2018-11-09 08:32:43.908000', '0');
INSERT INTO `demo_topic_reply` VALUES ('5be55250646a05745b7ba439', '5bdd1af6646a05745b7b7bf3', '2018111306345262828329801947', '<div class=\"markdown-text\"><p>我直接在devtool跑了下你贴的代码, 可以获取到json数据的啊</p>\n</div>', null, '2018-11-09 09:24:32.496000', '2018-11-09 09:24:32.496000', '0');
INSERT INTO `demo_topic_reply` VALUES ('5be2c9ad646a05745b7b9722', '5be2b2c121d75b74609f50d8', '2018111306344174566190394505', '<div class=\"markdown-text\"><p>如果是ajax我记得set-cookie是无效的，无法获得的</p>\n</div>', null, '2018-11-07 11:17:01.281000', '2018-11-07 11:17:01.281000', '0');
INSERT INTO `demo_topic_reply` VALUES ('5be2cc44646a05745b7b972d', '5be2b2c121d75b74609f50d8', '2018111306345262828329801947', '<div class=\"markdown-text\"><p>响应头里的 set-cookie 拿不到, 从 <code>document.cookie</code> 取, 但是有两个条件:</p>\n<ol>\n<li>接口必须和前端在同域</li>\n<li>cookie不能是http only</li>\n</ol>\n</div>', null, '2018-11-07 11:28:04.034000', '2018-11-07 11:28:04.034000', '0');
INSERT INTO `demo_topic_reply` VALUES ('5be2cd12646a05745b7b973e', '5be2b2c121d75b74609f50d8', '593129689a99de3b489289c5', '<div class=\"markdown-text\"><p><a href=\"/user/yinxin630\">@yinxin630</a> 额 我看express-session里面生成的cookie都是放在响应头里的诶  拿不到放在那里有什么用额</p>\n</div>', '5be2cc44646a05745b7b972d', '2018-11-07 11:31:30.963000', '2018-11-07 11:31:30.963000', '0');
INSERT INTO `demo_topic_reply` VALUES ('5be3aa2321d75b74609f54ca', '5be2b2c121d75b74609f50d8', '2018111306345262828329801947', '<div class=\"markdown-text\"><p><a href=\"/user/qqxwbtt\">@qqxwbtt</a> 浏览器接收到该响应头后, 会将要设置的cookie值存储到浏览器cookie中, 前端只能通过浏览器API获取浏览器cookie内容.</p>\n</div>', '5be2cd12646a05745b7b973e', '2018-11-08 03:14:43.609000', '2018-11-08 03:14:43.609000', '0');
INSERT INTO `demo_topic_reply` VALUES ('5be3d1cd21d75b74609f5603', '5be2b2c121d75b74609f50d8', '593129689a99de3b489289c5', '<div class=\"markdown-text\"><p><a href=\"/user/yinxin630\">@yinxin630</a> 这个过程是浏览器自动保存cookie的吗。。我这边没有看到浏览器有存储cookie诶， 还是不能跨域?cookie不能是http only</p>\n</div>', '5be3aa2321d75b74609f54ca', '2018-11-08 06:03:57.516000', '2018-11-08 06:03:57.516000', '0');
INSERT INTO `demo_topic_reply` VALUES ('5be4256e21d75b74609f580a', '5be2b2c121d75b74609f50d8', '2018111306343287815318329816', '<div class=\"markdown-text\"><p><a href=\"/user/yinxin630\">@yinxin630</a> 若服务器支持跨域，  通过  node-fetch 可以直接拿到的 。\n<a href=\"https://github.com/waitingsong/rxxfetch/blob/master/test/30_cookie.test.ts#L72\">https://github.com/waitingsong/rxxfetch/blob/master/test/30_cookie.test.ts#L72</a></p>\n</div>', '5be2cc44646a05745b7b972d', '2018-11-08 12:00:46.938000', '2018-11-08 12:00:46.938000', '0');
INSERT INTO `demo_topic_reply` VALUES ('5be4ec9e21d75b74609f5a13', '5be2b2c121d75b74609f50d8', '2018111306345262828329801947', '<div class=\"markdown-text\"><p><a href=\"/user/qqxwbtt\">@qqxwbtt</a> 自动的, 去 <code>chrome devtool =&gt; Application =&gt; Cookies</code> 查看</p>\n</div>', '5be3d1cd21d75b74609f5603', '2018-11-09 02:10:38.267000', '2018-11-09 02:10:38.267000', '0');
INSERT INTO `demo_topic_reply` VALUES ('5be4eeb221d75b74609f5a2c', '5be2b2c121d75b74609f50d8', '2018111306345262828329801947', '<div class=\"markdown-text\"><p><a href=\"/user/waitingsong\">@waitingsong</a> node-fetch是node环境吧, 浏览器环境中如果是跨域Ajax请求, 浏览器限制只允许拿到部分header, 这部分header不包括 <code>set-cookie</code>\n如果想暴露更多header可以参考: <a href=\"https://developer.mozilla.org/zh-CN/docs/Web/HTTP/Headers/Access-Control-Expose-Headers\">https://developer.mozilla.org/zh-CN/docs/Web/HTTP/Headers/Access-Control-Expose-Headers</a>\n我没尝试过能不能暴露 <code>set-cookie</code></p>\n</div>', '5be4256e21d75b74609f580a', '2018-11-09 02:19:30.197000', '2018-11-09 02:19:30.197000', '0');
INSERT INTO `demo_topic_reply` VALUES ('5be54f69646a05745b7ba420', '5be2b2c121d75b74609f50d8', '2018111306343287815318329816', '<div class=\"markdown-text\"><p><a href=\"/user/yinxin630\">@yinxin630</a>\n浏览器里拿cookie受限比较多。很可能拿不到（http only）。</p>\n</div>', '5be4eeb221d75b74609f5a2c', '2018-11-09 09:12:09.187000', '2018-11-09 09:12:09.187000', '0');
INSERT INTO `demo_topic_reply` VALUES ('51fc94dc44e76d216ab720c3', '51fc8bd944e76d216ab64939', '2018111306353459924529265486', '<div class=\"markdown-text\"><p>分享是不错的顶一下，但是附件csdn这个就要喷一下了，我擦csdn就TM垃圾站，密码泄露事件导致我的邮箱现在经常收到垃圾信息。</p>\n</div>', null, '2013-08-03 05:27:56.972000', '2013-08-03 05:27:56.972000', '0');
INSERT INTO `demo_topic_reply` VALUES ('520de12e99f5db772c057c47', '51fc8bd944e76d216ab64939', '2018111306353460824653006923', '<div class=\"markdown-text\"><p>这个，在win下是不是不能用这个东西？</p>\n</div>', null, '2013-08-16 08:22:06.888000', '2013-08-16 08:22:06.888000', '0');
INSERT INTO `demo_topic_reply` VALUES ('520f27a099f5db772c1f7051', '51fc8bd944e76d216ab64939', '2018111306353467825577238162', '<div class=\"markdown-text\"><p>可以 先要安装<code>GraphicsMagick</code></p>\n</div>', '520de12e99f5db772c057c47', '2013-08-17 07:34:56.510000', '2013-08-17 07:34:56.510000', '0');
INSERT INTO `demo_topic_reply` VALUES ('52ee02ed953654bb71819f4e', '51fc8bd944e76d216ab64939', '2018111306353468475627170043', '<div class=\"markdown-text\"><p>var gm = require(‘gm’);</p>\n<p>app.post(’/cut’, function(req, res) {\nvar imgPath = req.files.uploadFile.path;\nvar imgSize = req.files.uploadFile.size;\nvar imgName = <a href=\"http://req.files.uploadFile.name\">req.files.uploadFile.name</a>;</p>\n<p>console.log(imgPath);\nconsole.log(imgSize);\nconsole.log(imgName);</p>\n<p>var imageMagick = gm.subClass({ imageMagick : true });</p>\n<p>imageMagick(imgPath).resize(150, 150, ‘!’).autoOrient().write(‘public/images/user/’+ imgName, function(err){\nif (err) {\nconsole.log(err);\n}\n});</p>\n<p>res.send(‘11’);\n});</p>\n<p>最后打印的err：\n{ [Error: Command failed:   Ч   - -resize\n] code: 4, signal: null }</p>\n<p>能不能告诉下，这是为什么呢？</p>\n</div>', null, '2014-02-02 08:33:49.580000', '2014-02-02 08:33:49.580000', '0');
INSERT INTO `demo_topic_reply` VALUES ('52ee5175953654bb7186c4e9', '51fc8bd944e76d216ab64939', '2018111306353469525704135731', '<div class=\"markdown-text\"><p>仔细看一下<a href=\"http://aheckmann.github.io/gm/docs.html\">文档</a>，有一个专门做缩略图的函数，可以调整大小和质量</p>\n<p><code>gm(&quot;img.png&quot;).thumb(width, height, outName, quality, callback)</code></p>\n</div>', null, '2014-02-02 14:08:53.191000', '2014-02-02 14:08:53.191000', '0');
INSERT INTO `demo_topic_reply` VALUES ('52ee5bc0953654bb71875a36', '51fc8bd944e76d216ab64939', '2018111306353469525704135731', '<div class=\"markdown-text\"><p>不过似乎 gm.resize.quality.write 更合适……</p>\n</div>', '52ee5175953654bb7186c4e9', '2014-02-02 14:52:48.336000', '2014-02-02 14:52:48.336000', '0');
