INSERT INTO `demo_topic_reply` VALUES ('5336bf33ca4887794900eadc', '51fc8bd944e76d216ab64939', '2018111306353472076083435460', '<div class=\"markdown-text\"><p>可以参考下这个：</p>\n<pre class=\"prettyprint language-\"><code>gm(image)  \n.resize(options.width, options.height, &#x27;^&#x27;)  \n.gravity(options.crop)  \n.extent(options.width, options.height)  \n.toBuffer(callback);  \n</code></pre></div>', '53369c050eaf801f4801b3de', '2014-03-29 12:40:19.552000', '2014-03-29 12:40:19.552000', '0');
