INSERT INTO `demo_topic_reply` VALUES ('5be52a27646a05745b7ba280', '51fc8bd944e76d216ab64939', '2018111306353553586440315712', '<div class=\"markdown-text\"><p>可以用opencv4nodejs来做啊,</p>\n<blockquote>\n<p>const cv = require(‘opencv4nodejs’);\nasync function imgCut(){\nlet waldoMat = await cv.imreadAsync(<code>./data/s9.jpg</code>);\nlet rows = waldoMat.rows;\nlet cols = waldoMat.cols;\nlet x0=19;\nlet y0 = 17;\nlet waldoRect =  new cv.Rect(cols/2-x0,rows/2-y0,2<em>x0,2</em>y0);\nwaldoMat = waldoMat.getRegion(waldoRect);\n	 cv.imshow(‘We’ve found Waldo!’, originalMat);\ncv.waitKey();\n}\nimgCut();\n这是以坐标截取图片中间的部分,这个模块\n完美支持对图片的各种姿势,还可以做模型匹配,对象跟踪,人脸识别,绝对是目前破解某东反爬措施的一大神器</p>\n</blockquote>\n</div>', null, '2018-11-09 06:33:11.841000', '2018-11-09 06:33:11.841000', '0');
