INSERT INTO `demo_topic_reply` VALUES ('516e1ee96d382773067c728f', '516e0ab46d382773067a5473', '2018111306353805768485905175', '<div class=\"markdown-text\"><p>用csv处理汉字没有问题：</p>\n<pre class=\"prettyprint\"><code>var csv = require(&#x27;csv&#x27;);\nvar data = [ \n    [&#x27;john&#x27;, 23, &#x27;城市&#x27;],\n    [&#x27;john2&#x27;, 123, &#x27;male&#x27;],\n    [&#x27;john3&#x27;, 234, &#x27;female&#x27;]\n];\ncsv()\n.from.array(data)\n.to.path(&#x27;sample2.csv&#x27;);\n\n\n$ cat sample2.csv \njohn,23,城市\njohn2,123,male\njohn3,234,female</code></pre></div>', null, '2013-04-17 04:02:49.333000', '2013-04-17 04:02:49.333000', '0');
INSERT INTO `demo_topic_reply` VALUES ('5170bfe46d38277306c325d6', '516e0ab46d382773067a5473', '50cbf5fb637ffa41556d22f2', '<div class=\"markdown-text\"><p>你没理解我的意思     我的意思是将数据写入csv里面   然后用excel打开中文乱码</p>\n</div>', '516e1ee96d382773067c728f', '2013-04-19 03:54:12.578000', '2013-04-19 03:54:12.578000', '0');
INSERT INTO `demo_topic_reply` VALUES ('517143856d38277306cee460', '516e0ab46d382773067a5473', '2018111306353805768485905175', '<div class=\"markdown-text\"><p><a href=\"/user/zjshop\">@zjshop</a></p>\n<p><a href=\"http://www.csser.com/question/505ae0066f1f5a9d610004dd\">http://www.csser.com/question/505ae0066f1f5a9d610004dd</a>\n由于node.js 只支持‘ascii’ 、‘utf8’、‘base64’、‘binary’ 编码方式，不支持MS 的 utf-8 + BOM 格式。所以 excel 打开中文乱码。</p>\n<p>我是这么解决的：nodejs 生成的 csv 文件先用 Open Office 或 Libre Office 打开，存成 Office Excel 格式。这样就可以用 Excel 打开，中文没有乱码。</p>\n</div>', '516e1ee96d382773067c728f', '2013-04-19 13:15:49.100000', '2013-04-19 13:15:49.100000', '0');
INSERT INTO `demo_topic_reply` VALUES ('51739ba66d38277306f0cef9', '516e0ab46d382773067a5473', '2018111306353806968548748526', '<div class=\"markdown-text\"><p><a href=\"/user/leapon\">@leapon</a> 我也是这样的，我就想有没有更简洁的方法</p>\n</div>', '516e1ee96d382773067c728f', '2013-04-21 07:56:22.836000', '2013-04-21 07:56:22.836000', '0');
INSERT INTO `demo_topic_reply` VALUES ('5174b6536d3827730602d687', '516e0ab46d382773067a5473', '50cbf5fb637ffa41556d22f2', '<div class=\"markdown-text\"><p><a href=\"/user/leapon\">@leapon</a> 现在就是这个问题撒     只要是这个csv文件是供用户下载看的</p>\n</div>', '516e1ee96d382773067c728f', '2013-04-22 04:02:27.895000', '2013-04-22 04:02:27.895000', '0');
INSERT INTO `demo_topic_reply` VALUES ('5174c3aa6d3827730603fcf3', '516e0ab46d382773067a5473', '2018111306353807868686027105', '<div class=\"markdown-text\"><p><a href=\"/user/zjshop\">@zjshop</a> 根据 <a href=\"/user/leapon\">@leapon</a> 的回复，解决方法已经很明显了，既然excel需要BOM，每次写入数据前先加入一个BOM就可以了嘛。utf-8对应的BOM是 <code>EF BB BF</code>，稍微改动下1楼代码：</p>\n<pre class=\"prettyprint\"><code>var csv = require(&#x27;csv&#x27;),fs=require(&#x27;fs&#x27;);\nvar data = [ \n    [&#x27;john&#x27;, 23, &#x27;城市&#x27;],\n    [&#x27;john2&#x27;, 123, &#x27;male&#x27;],\n    [&#x27;john3&#x27;, 234, &#x27;female&#x27;]\n];\nvar fout=fs.createWriteStream(&#x27;sample2.csv&#x27;);\nfout.write(new Buffer(&#x27;\\xEF\\xBB\\xBF&#x27;,&#x27;binary&#x27;));&#x2F;&#x2F;add utf-8 bom\ncsv() .from.array(data) .to(fout);\n</code></pre><p>如此，excel直接打开文件也不会乱码了，转码GBK是不需要的，保持本身utf-8即可。</p>\n</div>', '516e1ee96d382773067c728f', '2013-04-22 04:59:22.381000', '2013-04-22 04:59:22.381000', '0');
INSERT INTO `demo_topic_reply` VALUES ('5174c45e6d3827730604143f', '516e0ab46d382773067a5473', '2018111306353805768485905175', '<div class=\"markdown-text\"><p><a href=\"/user/shiedman\">@shiedman</a> 高</p>\n</div>', '516e1ee96d382773067c728f', '2013-04-22 05:02:22.615000', '2013-04-22 05:02:22.615000', '0');
