INSERT INTO `demo_topic_reply` VALUES ('5174ebcd6d3827730608655f', '516e0ab46d382773067a5473', '50cbf5fb637ffa41556d22f2', '<div class=\"markdown-text\"><p><a href=\"/user/shiedman\">@shiedman</a> 还是会乱码的呀;代码如下：\nvar csvData = ‘“序号”,“检查人”,“检查日期”,“省”,“城市”,“系统”,“售点”,“地址”,“门店类型”’;\ncsvData = csvData.split(’,’);\nvar fout=fs.createWriteStream(config.UP_PATH+’/csv/aaa.csv’);\nfout.write(new Buffer(’\\xEF\\xBB\\xBF’,‘binary’));\ncsv().from.array(csvData ).to(fout);\nexcel打开如下：<img src=\"http://\" alt=\"enter image description here\"></p>\n</div>', '516e1ee96d382773067c728f', '2013-04-22 07:50:37.139000', '2013-04-22 07:50:37.139000', '0');
INSERT INTO `demo_topic_reply` VALUES ('5174eca96d38277306087f21', '516e0ab46d382773067a5473', '50cbf5fb637ffa41556d22f2', '<div class=\"markdown-text\"><p><a href=\"/user/shiedman\">@shiedman</a>  图片放不上来     附文字好了</p>\n<p>“搴忓彿”,“妫€鏌ヤ汉”,“妫€鏌ユ棩鏈?”,“鐪?”&quot;,“鍩庡競”  …后面的就不附上了，总之全是谢乱码</p>\n</div>', '516e1ee96d382773067c728f', '2013-04-22 07:54:17.468000', '2013-04-22 07:54:17.468000', '0');
