INSERT INTO `demo_topic_reply` VALUES ('517524966d382773060e38fa', '516e0ab46d382773067a5473', '2018111306353807868686027105', '<div class=\"markdown-text\"><p><a href=\"/user/zjshop\">@zjshop</a> <code>搴忓彿</code>的GBK字节＝<code>序号</code>的utf8字节，excel把cvs文件当gbk来处理了，也就是说很大的可能，BOM<code>EFBB BF</code>并没有加上去，请检查文件的头3个字节是什么。\n附上我机子上的运行结果：excel 2003，生成文件大小87字节，头3字节EF BB BF\n<a href=\"http://i.imgur.com/IPZfUKo.png\">http://i.imgur.com/IPZfUKo.png</a></p>\n</div>', '516e1ee96d382773067c728f', '2013-04-22 11:52:54.113000', '2013-04-22 11:52:54.113000', '0');
