INSERT INTO `demo_topic_reply` VALUES ('546f003a04ab9a14068551e0', '516e0ab46d382773067a5473', '2018111306343719540095817176', '<div class=\"markdown-text\"><p>@紫胤: 一个内部的终极解决方案</p>\n<h1>nodejs文件下载服务</h1>\n<h2>踩到的几个坑：</h2>\n<p>1.Excel2007 打开utf-8编码的csv文件默认乱码</p>\n<p>相关信息：<a href=\"http://www.docin.com/p-31710590.html\">http://www.docin.com/p-31710590.html</a></p>\n<p>2.文件名中含中文，下载会乱码。各浏览器表现不同</p>\n<p>相关信息：<a href=\"http://www.phpv.net/html/1675.html\">http://www.phpv.net/html/1675.html</a></p>\n<h2>解决方法：</h2>\n<p>iconv转码，utf-8 -&gt; gbk</p>\n<p>转完后为buffer对象，内容直接res.end(buffer), header中的filename则由buffer.toString(‘binary’);</p>\n<p><a href=\"http://127.0.0.1:22222/down\">http://127.0.0.1:22222/down</a></p>\n<pre class=\"prettyprint language-js\"><code>var http = require(&#x27;http&#x27;);\nvar url = require(&#x27;url&#x27;);\nvar Iconv = require(&#x27;iconv&#x27;).Iconv;\nvar crypto = require(&#x27;crypto&#x27;);\nvar server = http.createServer(function(req, res){\n  var path = url.parse(req.url).pathname;\n\n  if(path == &#x27;&#x2F;favicon.ico&#x27;){\n    res.end(&#x27;&#x27;);\n  }else{\n    var filename = &#x27;2012-06-01 至 2012-06-01 数据报表.csv&#x27;;\n    var content = &quot;序号,日期,成交商品数,客单价,关注次数,搜索次数,收藏人数\\n1, 2012-06-01, 1, 1, 1, 1, 1\\n1, 2012-06-02, 1, 1, 1, 1, 1&quot;;\n    &#x2F;&#x2F;excel2007默认不支持utf-8编码的csv文件\n    var iconv = new Iconv(&#x27;UTF-8&#x27;, &#x27;GBK&#x2F;&#x2F;IGNORE&#x27;);\n    content = iconv.convert(content);\n    res.setHeader(&#x27;Pragma&#x27;, &#x27;public&#x27;);\n    res.setHeader(&#x27;Expires&#x27;, &#x27;0&#x27;);\n    res.setHeader(&#x27;Cache-Control&#x27;, &#x27;no-store, no-cache, must-revalidate, max-age=0&#x27;);\n&#x2F;&#x2F;    res.setHeader(&#x27;Cache-Control&#x27;, &#x27;pre-check=0, post-check=0, max-age=0&#x27;);\n&#x2F;&#x2F;    res.setHeader(&#x27;Content-Transfer-Encoding&#x27;, &#x27;none&#x27;);\n    res.setHeader(&#x27;Content-Type&#x27;, &#x27;text&#x2F;csv; charset=GBK&#x27;);\n    filename = iconv.convert(filename).toString(&#x27;binary&#x27;);\n    res.setHeader(&#x27;Content-Disposition&#x27;, &#x27;attachment;filename=&quot;&#x27;+ filename +&#x27;&quot;&#x27;);\n    res.setHeader(&#x27;Content-Length&#x27;, content.length);\n    res.end(content);\n  }\n}).listen(22222);\n</code></pre></div>', null, '2014-11-21 09:04:58.994000', '2014-11-21 09:04:58.994000', '0');
INSERT INTO `demo_topic_reply` VALUES ('546fdcc6a3e2aee40698ddb3', '516e0ab46d382773067a5473', '2018111306353492528632608740', '<div class=\"markdown-text\"><p>用 gbk。输出就好了</p>\n</div>', null, '2014-11-22 00:45:58.444000', '2014-11-22 00:45:58.444000', '0');
INSERT INTO `demo_topic_reply` VALUES ('5536fadd48636414313a7331', '516e0ab46d382773067a5473', '2018111306352350304989033329', '<div class=\"markdown-text\"><p>我也来挖坟了，今天也碰到这个问题，其实解决起来很简单，相关代码如下：</p>\n<pre class=\"prettyprint\"><code>var iconv = new Iconv(&#x27;UTF-8&#x27;, &#x27;GBK&#x27;);\n... &#x2F;&#x2F;获取你的json\njson2csv({data: result, fields: Object.keys(result[0] || {})}, function(err, csv) {\n&#x2F;&#x2F;将json转为csv格式的buf\n&#x2F;&#x2F;在写文件之前，转一下编码\n	var buf = iconv.convert(csv)\n&#x2F;&#x2F;然后保存到文件中，在win7 office 2010 打开没问题\n	fs.writeFile(xlsPath, buf, function (err) {\n				  if (err) throw err;\n				  console.log(&#x27;It\\&#x27;s saved!&#x27;);\n		});\n})\n</code></pre></div>', null, '2015-04-22 01:35:25.708000', '2015-04-22 01:35:25.708000', '0');
