INSERT INTO `demo_topic_reply` VALUES ('5b44678d13ca2fe569fb9270', '5b3748c457137f22415c5143', '5b37469f57137f22415c5140', '<div class=\"markdown-text\"><p><a href=\"/user/yuu2lee4\">@yuu2lee4</a> 三年以前比较流行的网页开发技术是php，php开源的项目多。</p>\n<p>现在的话nodejs发展也是非常成熟的，nodejs的模块也很多，开发速度不比php差，并且用的是前端的js语法。</p>\n<p>后端的话用什么都是可以的  php  java  python  nodejs都可以的。</p>\n<p>nodejs在大数据时代有它的意义，高并发。大前端时代nodejs也有自己的意义，那就是前端全栈（学习、开发成本低） 。</p>\n</div>', '5b4435ca13ca2fe569fb925e', '2018-07-10 08:00:13.613000', '2018-07-10 08:00:13.613000', '0');
