INSERT INTO `demo_topic_reply` VALUES ('5be44a69646a05745b7b9eaa', '5be4481b646a05745b7b9e9d', '2018111306343304716358894956', '<div class=\"markdown-text\"><p>常见有两种</p>\n<ol>\n<li>端口被占用</li>\n<li>Linux下使用1024以下端口需要root权限</li>\n</ol>\n</div>', null, '2018-11-08 14:38:33.103000', '2018-11-08 14:38:33.103000', '0');
INSERT INTO `demo_topic_reply` VALUES ('5be44f88646a05745b7b9eb5', '5be4481b646a05745b7b9e9d', '5a924b1e71327bb413bbfe26', '<div class=\"markdown-text\"><p><a href=\"/user/zy445566\">@zy445566</a> 权限加了， 端口被占用的话，不可能每个域名都被占用了80端口。</p>\n</div>', '5be44a69646a05745b7b9eaa', '2018-11-08 15:00:24.675000', '2018-11-08 15:00:24.675000', '0');
INSERT INTO `demo_topic_reply` VALUES ('5be4d177646a05745b7b9ef3', '5be4481b646a05745b7b9e9d', '2018111306354439994280590495', '<div class=\"markdown-text\"><p>你的域名应该不是真实的吧？你看下nginx.conf文件，里面应该有server default的配置，你自己的配置里用80端口，域名不是真的话，相当于也是启动本地的地址80端口，和nginx.conf里的配置冲突，会不会报错我也不清楚！然后你访问的时候，其实是走到默认配置里的那个了。当时使用9666端口的时候，和那个默认配置不冲突，所以没问题。我猜测是这个原因</p>\n<p>来自酷炫的 <a href=\"https://github.com/TakWolf/CNode-Material-Design\">CNodeMD</a></p>\n</div>', null, '2018-11-09 00:14:47.034000', '2018-11-09 00:14:47.034000', '0');
INSERT INTO `demo_topic_reply` VALUES ('5be4e5d821d75b74609f5970', '5be4481b646a05745b7b9e9d', '2018111306352526515096514450', '<div class=\"markdown-text\"><p>1.域名真实有效？\n2.域名是否有做解析？\n3.最重要一点：如果是大陆服务器，备案了吗？?</p>\n<p>另外：同一楼，80端口是否被占用</p>\n</div>', null, '2018-11-09 01:41:44.274000', '2018-11-09 01:41:44.274000', '0');
